(49, '49409c50-ea6f-4feb-839e-5f0ef050204f', 'Ưu điểm vượt trội', '<p>Chi phí hợp lý<br />\r\n&nbsp;</p>', 'http://localhost:8000/uploads/images/rocket-launch.svg', '<p>Khởi tạo một server mới chỉ trong 45 giây. Tạo và gắn thêm ổ cứng vào server chỉ với 2 giây.</p>', NULL, 9, 'on', 10, NULL, '2021-06-30 20:02:58', '2021-06-30 20:02:58'),
(50, 'dc8ac6c7-ae00-4434-98eb-7778ddb3d282', 'Dịch vụ lưu trữ hồ sơ', '<p>Dịch vụ lưu trữ hồ sơ</p>', NULL, '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', NULL, 1, 'on', 11, NULL, '2021-06-30 20:03:25', '2021-06-30 20:03:25'),
(51, '48342ca5-a9d9-47ba-aad1-e2e59982ab57', 'Trải nghiệm dịch vụ gigaton', '<p>Trải nghiệm dịch vụ gigaton<br />\r\n&nbsp;</p>', NULL, '<p>Quý khách hàng có thể dùng thử sản phẩm Cloud Server bằng một trong hai cách: Chọn cấu hình dùng thử có sẵn hoặc tuỳ chỉnh cấu hình dùng thử.</p>', NULL, 2, 'on', 11, NULL, '2021-06-30 20:03:57', '2021-06-30 20:03:57'),
