(10, '466d4adb-00be-4f26-b3bf-824a93ba0d7e', 'DỊCH VỤ CHO THUÊ KHO CHUNG', '<p>BizFly Cloud Server - Dịch vụ máy chủ ảo đám mây tốc độ cao, chuyên nghiệp</p>', '<p>Dịch vụ cho thuê kho hàng là gì?</p>', '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', NULL, NULL, 'dich-vu-cho-thue-kho-chung', 'DỊCH VỤ CHO THUÊ KHO CHUNG', NULL, NULL, 'index,follow', 'index,follow', 'vi', 9, NULL, '2021-06-29 06:25:24', '2021-06-29 07:21:37'),
(11, 'e2b5d41c-7cfa-4882-aa26-f7affed2dede', 'DỊCH VỤ FULLFILLMENT', '<p>BizFly Cloud Server - Dịch vụ máy chủ ảo đám mây tốc độ cao, chuyên nghiệp</p>', '<p>Dịch vụ Fullfillment là gì?</p>', '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', NULL, 'Dịch vụ Fullfillment là gì?', 'dich-vu-fullfillment', 'DỊCH VỤ FULLFILLMENT', NULL, NULL, 'index,follow', 'index,follow', 'vi', 10, NULL, '2021-06-29 06:25:35', '2021-06-29 07:21:45'),
(12, 'ca99fa81-60be-49e5-affa-b92cb4782c23', 'DỊCH VỤ LƯU TRỮ HỒ SƠ', '<p>BizFly Cloud Server - Dịch vụ máy chủ ảo đám mây tốc độ cao, chuyên nghiệp</p>', '<p>Dịch vụ lưu trữ hồ sơ là gì ?</p>', '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', NULL, NULL, 'dich-vu-luu-tru-ho-so', 'DỊCH VỤ LƯU TRỮ HỒ SƠ', NULL, NULL, 'index,follow', 'index,follow', 'vi', 11, NULL, '2021-06-29 06:25:48', '2021-06-29 07:21:52');
