INSERT INTO `gigation_news_translations` (`id`, `uuid`, `title`, `author`, `copyright`, `intro`, `content`, `foot`, `image`, `youtube`, `file`, `slug`, `title_tag`, `meta_keywords`, `meta_description`, `meta_robots`, `meta_google_bot`, `locale`, `news_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'b56ce4d8-b32a-44e8-89c3-fd8815fc6850', 'Nhân viên Kho Bán Hàng Bách Hóa Xanh', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC</h2>\r\n\r\n<p>- Tư vấn hỗ trợ Khách hàng đến siêu thị</p>\r\n\r\n<p>- Trưng bày, sắp xếp hàng hóa đảm bảo quầy kệ gọn gàng, sạch sẽ</p>\r\n\r\n<p>- Làm cá, thịt, sơ chế món ăn có sẵn, các thực phẩm tươi sống</p>\r\n\r\n<p>- Kiểm kê hàng hóa siêu thị</p>\r\n\r\n<p>- Hủy hàng theo quy định triển khai công ty</p>\r\n\r\n<p>- Nhập hàng từ nhà cung cấp hoặc kho tổng ( Cân, nhập, kiểm đếm)</p>\r\n\r\n<p>- Vệ sinh siêu thị ( Lau dọn sàn, kính, quầy kệ)</p>\r\n\r\n<p>- Bưng bê/sắp xếp hàng, quản lý kho hàng gọn gàng</p>\r\n\r\n<p>- Tính chất công việc đa nhiệm nên có thể làm thu ngân luân phiên</p>\r\n\r\n<p>- Các công việc vệ sinh siêu thị theo phân công Quản lý&nbsp;</p>', '<h4 data-v-515c0965=\"\">&nbsp;</h4>\r\n\r\n<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>- Nam/ Nữ từ 18- 40 tuổi</p>\r\n\r\n<p>- Thân thiện, vui vẻ, xởi lởi</p>\r\n\r\n<p>- Có sức khỏe tốt, tháo vát</p>\r\n\r\n<p>**&nbsp; Những yêu cầu công việc bắt buộc sau đây:</p>\r\n\r\n<p>+&nbsp; Có smartphone để làm việc, có phương tiện di chuyển (xe máy)</p>\r\n\r\n<p>+ Sẵn sàng làm sơ chế thịt, cá</p>\r\n\r\n<p>+&nbsp; Bắt buộc làm ca đêm&nbsp;luân phiên trong tuần</p>\r\n\r\n<p>+ Bắt buộc làm việc theo ca xoay theo sự phân công của Quản lý ( không tự đăng ký ca hoặc không cố định ca)</p>\r\n\r\n<p>Bao gồm 3 ca xoay:</p>\r\n\r\n<p>+ Ca Sáng: 5h30 - 14h30</p>\r\n\r\n<p>+ Ca Chiều: 14h30 - 22g00</p>\r\n\r\n<p>+ Ca Đêm: 22g00 - 5h30</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Thu nhập trung bình từ 5 - 8 triệu trở lên, tăng lên theo hiệu quả làm việc và giờ công làm việc</p>\r\n\r\n<p>-&nbsp;Thưởng trong tháng và thưởng cuối năm hấp dẫn</p>\r\n\r\n<p>-&nbsp;Cơ hội thăng tiến lên Quản lý</p>\r\n\r\n<p>- Được bố trí làm việc thuận tiện gần nhà</p>\r\n\r\n<p>- Được hướng dẫn, đào tạo phát triển kỹ năng/ chuyên môn</p>\r\n\r\n<p>- Ký Hợp đồng lao động, công việc chính thức Lâu dài - Ổn định</p>\r\n\r\n<p>- Môi trường làm việc thân thiện, hỗ trợ đồng đội</p>\r\n\r\n<p>- Phúc lợi đầy đủ : Tham gia BHYT, BHXH, Đi du lịch Teambuilding, 12 ngày phép/ năm, nghỉ thai sản, ốm đau...</p>', '<h2>LƯU Ý</h2>\r\n\r\n<p>- Công việc làm chính thức, không phù hợp cho học sinh/ sinh viên đang có chương trình học</p>\r\n\r\n<p>- Nhân viên làm việc linh hoạt, đa nhiệm vị trí trong siêu thị</p>\r\n\r\n<p>- Vì phạm vi kinh doanh có liên quan tới Luật An Toàn Thực Phẩm nên ứng viên đang mắc các bệnh dễ lây nhiễm sẽ không phù hợp làm việc tại Bách Hóa Xanh ( VD:&nbsp;bệnh tả, lỵ, thương hàn, viêm gan A, E, viêm da nhiễm trùng, lao phổi,...”- tham khảo Nghị định số 155/2018/NĐ-CP).</p>\r\n\r\n<p>- Công việc bắt buộc tiếp xúc thịt cá, sơ chế thịt cá nên có thể không phù hợp nếu điều kiện của ứng viên không cho phép ( tín ngưỡng, quan điểm cá nhân...)</p>\r\n\r\n<p>- Công việc sắp xếp thuận tiện gần nhà nhất ( trong phạm vi còn có nhu cầu tuyển dụng)</p>', 'http://localhost:8000/uploads/files/5co5khong.jpg', NULL, NULL, 'nhan-vien-kho-ban-hang-bach-hoa-xanh', 'Nhân viên Kho Bán Hàng Bách Hóa Xanh', NULL, NULL, 'index,follow', 'index,follow', 'vi', 1, NULL, '2021-06-24 09:56:39', '2021-06-25 01:32:35'),
(2, '1257bf58-cd6e-4bb2-8e86-b97a4cccf834', 'Nhân viên SEO và Traffics website TGDĐ/ĐMX', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC:</h2>\r\n\r\n<p>- Lên kế hoạch, hành động (viết bài, chèn link, backlink…) cụ thể đánh ontop list keywords mục tiêu từ quản lý</p>\r\n\r\n<p>- Theo dõi, report hiệu quả và đưa ra các hành động về thứ hạng keyword, traffic, số lượng bài viết… hàng tuần, tháng cho các bộ phận liên quan bằng Search Console, Ahrefs, Google Analytic, Data studio….</p>\r\n\r\n<p>- &nbsp;Phối hợp với phòng ban liên quan đảm bảo tất cả bài viết trên trang phải chuẩn SEO</p>\r\n\r\n<p>- &nbsp;Quản lý, đào tạo, phân phối và kiểm soát công việc cho thực tập sinh (ít nhất 4 TTS, 8 CTV)</p>\r\n\r\n<p>- &nbsp;Tìm đề tài, lên outline, triển khai bài viết trên các website DMX, TGDĐ và hệ thống site vệ tinh (nếu có)&nbsp;</p>\r\n\r\n<p>- Làm các công việc khác do quản lý giao.</p>', '<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>- Nam/ nữ, tốt nghiệp CĐ/ĐH</p>\r\n\r\n<p>- Có kiến thức SEO onpage căn bản tới chuyên sâu</p>\r\n\r\n<p>- Mindset tốt về SEO, người dùng, luôn cập nhật xu hướng SEO mới của thế giới</p>\r\n\r\n<p>- Sử dụng tốt các công cụ SEO như ahrefs, keywordtool.io, Website Auditor, Google Spreadsheet…</p>\r\n\r\n<p>- Hiểu và sử dụng Google Analytic, Google Console, Data Studio</p>\r\n\r\n<p>- Có kinh nghiệm khai báo Schema cho website</p>\r\n\r\n<p>- Phải chịu được áp lực với hàm lượng công việc lớn, số lượng keyword phụ trách lớn từ 1.000 - 10.000 keyword</p>\r\n\r\n<p><b>** Điểm cộng nếu có:&nbsp;</b></p>\r\n\r\n<p>+ Đã có kinh nghiệm quản lý thực tập sinh, cộng tác viên, từng làm trưởng nhóm, lead dự án.</p>\r\n\r\n<p>+ Từng triển khai các dự án lớn ( quy mô từ 100 kw)</p>\r\n\r\n<p>+ Tiếng Anh đọc hiểu tốt.</p>\r\n\r\n<p>+ Biết HTML cơ bản.</p>\r\n\r\n<p>+ Biết code Google App Script xử lý dữ liệu trên Google Spreadsheet</p>\r\n\r\n<p>+ Từng triển khai các site vệ tinh, social.</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Môi trường làm việc chuyên nghiệp, lớn mạnh (Bộ phận content + SEO &gt;20 người)</p>\r\n\r\n<p>- Cơ hội phát triển bản thân, được thúc đẩy sáng tạo ra giá trị mới cho bộ phận, công ty</p>\r\n\r\n<p>- Cọ xát &amp; chia sẻ từ đội ngũ đồng nghiệp, quản lý dày dặn kinh nghiệm</p>\r\n\r\n<p>- Cơ hội thăng tiến rõ ràng</p>\r\n\r\n<p>- Ký HĐLĐ, Phúc lợi đầy đủ tăng dần, Du lịch Team building hàng năm</p>\r\n\r\n<p>- Thưởng cuối năm hấp dẫn (3-9 tháng theo KPI – Số liệu 2020)</p>', '<h2>Lưu ý</h2>\r\n\r\n<p>- Làm việc tại trụ sở MWG Quận 9 HCM<br />\r\n-&nbsp;Nhân viên tự trang bị Laptop cá nhân (cấu hình laptop đủ để cài &amp; thao tác Photoshop cơ bản)</p>', 'http://localhost:8000/uploads/files/web-5-01.jpg', NULL, NULL, 'nhan-vien-seo-va-traffics-website-tgdddmx', 'Nhân viên SEO và Traffics website TGDĐ/ĐMX', NULL, NULL, 'index,follow', 'index,follow', 'vi', 2, NULL, '2021-06-24 09:58:08', '2021-06-25 01:32:53'),
(3, '4383b312-aafd-4e39-b4ed-6bb081a136b8', 'Nhân viên Content sản phẩm TGDĐ/ĐMX', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC</h2>\r\n\r\n<p>- Quản lý thực tập sinh, CTV sản xuất bài viết, hình ảnh, thông số kỹ thuật SP</p>\r\n\r\n<p>- Quản lý thực tập sinh, CTV sản xuất nội dung giải thích công nghệ, tư vấn chọn mua, hướng dẫn sử dụng SP</p>\r\n\r\n<p>- Khảo sát Khách hàng để thực hiện tối ưu các tính năng, bộ lọc, kết quả tìm kiếm... giúp khách hàng mua SP</p>\r\n\r\n<p>- Phối hợp team SEO onpage 100% SP on top google tìm kiếm</p>\r\n\r\n<p>- Phối hợp team chụp hình, quay clip sản phẩm đảm bảo SP có hình ảnh &amp; video có yếu tố trải nghiệm</p>\r\n\r\n<p>- Các công việc khác do trưởng nhóm phân công</p>', '<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>- Có khả năng chịu được áp lực khối lượng công việc lớn, nhịp độ nhanh, đa nhiệm</p>\r\n\r\n<p>- Có kinh nghiệm làm việc, quản lý thực tập sinh, cộng tác viên nội dung hoặc lĩnh vực bất kì</p>\r\n\r\n<p>- Viết tốt, diễn đạt súc tích, rành mạch, dễ hiểu, đúng chính tả.</p>\r\n\r\n<p>- Yêu thích và hay tìm hiểu lĩnh vực công nghệ, điện máy, điện gia dụng…</p>\r\n\r\n<p>- Biết xử lý hình ảnh bằng Photoshop hoặc Figma cơ bản (cắt, ghép, chỉnh màu, chỉnh sáng…)</p>\r\n\r\n<p>- Tin học văn phòng (soạn thảo văn bản, xử lý dữ liệu bằng hàm excel, làm file trình chiếu, Google Drive...)</p>\r\n\r\n<p>- Có tư duy về đo lường &amp; tối ưu hiệu quả công viêc</p>\r\n\r\n<p>*** Điểm cộng</p>\r\n\r\n<p>- Tiếng Anh đọc hiểu tốt</p>\r\n\r\n<p>- Có kiến thức về SEO</p>\r\n\r\n<p>- Có kinh nghiệm bán hàng online/truyền thống</p>\r\n\r\n<p>- Hiểu biết về code/ html...</p>\r\n\r\n<p>- Sử dụng và hiểu các chỉ số Google Analytic</p>\r\n\r\n<p>- Tư duy hệ thống trong công việc</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Môi trường làm việc chuyên nghiệp, lớn mạnh (Bộ phận content + SEO &gt;20 người)</p>\r\n\r\n<p>- Cơ hội phát triển bản thân, được thúc đẩy sáng tạo ra giá trị mới cho bộ phận, công ty</p>\r\n\r\n<p>- Cọ xát &amp; chia sẻ từ đội ngũ đồng nghiệp, quản lý dày dặn kinh nghiệm</p>\r\n\r\n<p>- Cơ hội thăng tiến rõ ràng</p>\r\n\r\n<p>- Ký HĐLĐ, Phúc lợi đầy đủ tăng dần, Du lịch Team building hàng năm</p>\r\n\r\n<p>- Thưởng cuối năm hấp dẫn (3-9 tháng theo KPI – Số liệu 2020)</p>', '<h2>LƯU Ý</h2>\r\n\r\n<p>- Làm việc tại trụ sở MWG Quận 9 HCM</p>\r\n\r\n<p>- Nhân viên tự trang bị Laptop cá nhân</p>', 'http://localhost:8000/uploads/files/web-5-02.jpg', NULL, NULL, 'nhan-vien-content-san-pham-tgdddmx', 'Nhân viên Content sản phẩm TGDĐ/ĐMX', NULL, NULL, 'index,follow', 'index,follow', 'vi', 3, NULL, '2021-06-24 10:00:28', '2021-06-25 01:33:07'),
(4, '45506901-9b2f-4ba9-913a-0731374b706e', 'Nhân viên sản xuất Media', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC</h2>\r\n\r\n<p>- Setup các bối cảnh quay tại studio cho các clip kênh.</p>\r\n\r\n<p>- Setup các bối cảnh quay các clip viral của các hãng.</p>\r\n\r\n<p>- Chuẩn bị tiền kỳ cho các clip ngoại cảnh và studio theo yêu cầu của kịch bản</p>\r\n\r\n<p>- Khảo sát địa điểm, cảnh quay cho phu hợp với từng yêu cầu của từng clip.</p>\r\n\r\n<p>- Khuân vác đèn, máy quay, và các đạo cụ lúc quay.</p>\r\n\r\n<p>- Chuẩn bị các thiết kế, in ấn, chuẩn bị đạo cụ, trang phục, chi tiết theo kịch bản.</p>\r\n\r\n<p>- Lo hậu cần trong lúc quay.</p>', '<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>- Nam/nữ tuổi từ 20 - 30.</p>\r\n\r\n<p>- Tốt nghiệp TC/CĐ/ĐH (không giới hạn chuyên ngành).</p>\r\n\r\n<p>- Chăm chỉ, chịu được áp lực và có trách nhiệm với công việc.</p>\r\n\r\n<p>- Lanh lợi, sáng tạo.</p>\r\n\r\n<p>- Có khả năng làm việc độc lập và làm việc nhóm.</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Thu nhập: 8tr - 12tr/tháng.</p>\r\n\r\n<p>- Ký HĐLĐ, tham gia BHXH, BHYT + Chính sách phúc lợi đầy đủ.</p>\r\n\r\n<p>- Thưởng cuối năm hấp dẫn.</p>\r\n\r\n<p>- Luôn được tạo điều kiện tốt về cơ sở, thiết bị để phục vụ công việc.</p>\r\n\r\n<p>- Làm việc trong môi trường năng động, thử thách và có cơ hội học hỏi.</p>', '<h2>LƯU Ý</h2>\r\n\r\n<p>- Địa điểm làm việc: Văn phòng Media (ĐMX Hậu Giang, quận 6, TP. HCM).</p>\r\n\r\n<p>- Thời gian làm việc: Từ 09h00 đến 18h00 (Thứ 2 – Thứ 7) =&gt; Lịch làm việc có thể linh động thay đổi theo project.</p>', 'http://localhost:8000/uploads/files/web-2-02.jpg', NULL, NULL, 'nhan-vien-san-xuat-media', 'Nhân viên sản xuất Media', NULL, NULL, 'index,follow', 'index,follow', 'vi', 4, NULL, '2021-06-24 10:01:40', '2021-06-25 01:33:25'),
(5, '09d22e87-769d-4930-8ee1-c4a6ddbead78', 'Nhân viên quay dựng video', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC</h2>\r\n\r\n<p><b>* QUAY VIDEO:</b></p>\r\n\r\n<p>- Quay các clip review, tin tức, recap sự kiện, viral clip... cho các kênh Youtube TGDĐ, ĐMX, BHX.</p>\r\n\r\n<p>- Setup và livestream các sự kiện hoặc các hoạt động khác của công ty.</p>\r\n\r\n<p>- Hỗ trợ team hậu kỳ edit các clip đơn giản khi cần.</p>\r\n\r\n<p>- Phối hợp với các bộ phận khác đảm bảo công việc và deadline của bộ phận.</p>\r\n\r\n<p>- Quay các clip quảng cáo, viral,…</p>\r\n\r\n<p><b>* DỰNG VIDEO:</b></p>\r\n\r\n<p>- Chỉnh sửa hậu kỳ cho các clip của bộ phận sản xuất.</p>\r\n\r\n<p>- Chuyên trách một trong những kỹ năng: Edit, Color-grading, VFX, Motion Graphic, Audio... (nếu có thể).</p>\r\n\r\n<p>- Kết hợp với team tiền kỳ để tạo thuận lợi cho việc hậu kỳ</p>\r\n\r\n<p>- Hỗ trợ các công việc khác của team.</p>', '<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>- Nam/nữ tuổi từ 20 - 30.</p>\r\n\r\n<p>- Chịu được áp lực cao trong công việc.</p>\r\n\r\n<p>- Tận tình, có tinh thần trách nhiệm.</p>\r\n\r\n<p>- Ham học hỏi, cầu tiến.</p>\r\n\r\n<p><b>* QUAY VIDEO:</b></p>\r\n\r\n<p>- Sử dụng tốt các loại máy mirrorless/DSLR dùng để quay (chụp khi cần thiết).</p>\r\n\r\n<p>- Có kinh nghiệm sử dụng máy quay chuyên nghiệp.</p>\r\n\r\n<p>- Có khả năng dựng phim cơ bản.</p>\r\n\r\n<p>- Giao tiếp tốt, hoà đồng và có khả năng làm việc độc lập/làm việc nhóm tốt.</p>\r\n\r\n<p><b>* DỰNG VIDEO:</b></p>\r\n\r\n<p>- Tư duy dựng phim tốt.</p>\r\n\r\n<p>- Sử dụng tốt các phần mềm dựng phim (Premiere Pro, Affter Effect...) và các phần mềm bổ trợ.</p>\r\n\r\n<p>- Biết chỉnh màu trên Davinci Resolve hoặc Motion Graphics là một lợi thế.</p>\r\n\r\n<p>- Giao tiếp tốt, hoà đồng và có khả năng làm việc độc lập/làm việc nhóm tốt.</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Thu nhập: 9tr - 13tr/tháng.</p>\r\n\r\n<p>- Được ký HĐLĐ, tham gia BHXH, BHYT + Chính sách phúc lợi đầy đủ.</p>\r\n\r\n<p>- Du lịch với công ty hằng năm.</p>\r\n\r\n<p>- Thưởng cuối năm hấp dẫn.</p>\r\n\r\n<p>- Luôn được tạo điều kiện tốt về cơ sở, thiết bị để phục vụ công việc.</p>\r\n\r\n<p>- Làm việc trong môi trường năng động, thử thách và có cơ hội học hỏi.</p>', '<h2>LƯU Ý</h2>\r\n\r\n<p>- Địa điểm làm việc: Văn phòng Media (ĐMX Hậu Giang, quận 6, TP. HCM).</p>\r\n\r\n<p>- Thời gian làm việc: Từ 09h00 đến 18h00 (Thứ 2 – Thứ 7) =&gt; Lịch làm việc có thể linh động thay đổi theo project.</p>', 'http://localhost:8000/uploads/files/web-2-02(1).jpg', NULL, NULL, 'nhan-vien-quay-dung-video', 'Nhân viên quay dựng video', NULL, NULL, 'index,follow', 'index,follow', 'vi', 5, NULL, '2021-06-24 10:02:47', '2021-06-25 01:33:50'),
(6, 'dd42fc69-93f5-4f93-bda7-853e9da41e83', 'UX/UI Designer (website TGDĐ/ĐMX)', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC</h2>\r\n\r\n<p>1. Tham gia thiết kế UI/UX cho hệ thống Website, App Thegioiddiong.com, DienmayXanh.com</p>\r\n\r\n<p>2. Phối hợp thiết kế, tư vấn giải pháp cho các chương trình bán hàng Online và tính năng trên Website và App</p>\r\n\r\n<p>3. Phân tích và đưa ra phương án cải thiện sản phẩm dựa trên số liệu, khảo sát về hành vi người dùng</p>', '<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>1. Sử dụng thành thạo các công cụ đồ họa: Figma, Sketch, Photoshop, AI</p>\r\n\r\n<p>2. Am hiểu về hành vi của người dùng trên Desktop, Mobile, App</p>\r\n\r\n<p>3. Có ít nhất 1 năm kinh nghiệm làm việc trong lĩnh vực thiết kế đồ họa/ UX.UI Designer</p>\r\n\r\n<p>4. Có thẩm mỹ tốt, năng động trong công việc</p>\r\n\r\n<p>5. Biết sử dụng Adobe After Effect, có kinh nghiệm làm việc trong mảng Thương Mại Điện Tử là 1 lợi thế</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Làm việc tại tập đoàn bán lẻ hàng đầu Việt Nam&nbsp;</p>\r\n\r\n<p>- Môi trường làm việc chuyên nghiệp, lớn mạnh</p>\r\n\r\n<p>- Cọ xát kinh nghiệm từ đội ngũ nhân viên dày dặn kinh nghiệm</p>\r\n\r\n<p>- Ký HĐLĐ, Phúc lợi đầy đủ tăng dần</p>\r\n\r\n<p>- Du lịch Teambuilding hàng năm</p>\r\n\r\n<p>- Thưởng cuối năm hấp dẫn&nbsp;</p>', NULL, 'http://localhost:8000/uploads/files/web-2-04.jpg', NULL, NULL, 'uxui-designer-website-tgdddmx', 'UX/UI Designer (website TGDĐ/ĐMX)', NULL, NULL, 'index,follow', 'index,follow', 'vi', 6, NULL, '2021-06-24 10:03:42', '2021-06-25 01:34:05'),
(7, '81d3ff18-f485-4b06-be2f-e9bc2427ebd0', 'Nhân viên Content website Nhà Thuốc An Khang', 'Vũ Quốc Tuấn', NULL, '<h2>MÔ TẢ CÔNG VIỆC</h2>\r\n\r\n<p>Là Nhân viên Content sản phẩm, bạn sẽ:</p>\r\n\r\n<p>- Chịu trách nhiệm về thông tin sản phẩm, hình ảnh của sản phẩm mình phụ trách trên website&nbsp;<a href=\"http://nhathuocankhang.com/\" target=\"_blank\">Nhathuocankhang.com</a></p>\r\n\r\n<p>- Đảm bảo cập nhật thông tin, hình ảnh lên website: Đúng, đủ và kịp thời.</p>\r\n\r\n<p>- Chịu trách nhiệm về SEO cho sản phẩm, ngành hàng mình phụ trách.</p>\r\n\r\n<p>- Thực hiện những công việc khác theo yêu cầu và phân công của cấp trên.</p>\r\n\r\n<p>Là Content chuyên mục sức khỏe, bạn sẽ:</p>\r\n\r\n<p>- Xây dựng , phát triển nội dung cho trang web&nbsp;<a href=\"http://nhathuocankhang.com/\" target=\"_blank\">Nhathuocankhang.com</a></p>\r\n\r\n<p>- Lên ý tưởng cho các bài viết liên quan đến chuyên mục sức khỏe, thông tin về bệnh...</p>\r\n\r\n<p>- Theo dõi và cập nhật thông tin mới nhất về các vấn đề sức khỏe tại thời điểm hiện tại và đưa ra kế hoạch phù hợp.</p>\r\n\r\n<p>- Tối ưu hóa SEO, đưa các bài viết lên top google.</p>\r\n\r\n<p>-&nbsp;Quản lý Fanpage Facebook Nhà thuốc An Khang.</p>\r\n\r\n<p>- Thực hiện những công việc khác theo yêu cầu và phân công của cấp trên.</p>', '<h2>YÊU CẦU CÔNG VIỆC</h2>\r\n\r\n<p>- Nam/ Nữ thân thiện từ 22 tuổi trở lên</p>\r\n\r\n<p>- Tốt nghiệp Trung cấp/ Cao đẳng/Đại học chuyên ngành Dược.</p>\r\n\r\n<p>- Trung thực, hoạt bát, vui vẻ hòa đồng</p>\r\n\r\n<p>- Thân thiện, yêu nghề Dược, chú trọng phục vụ Khách Hàng</p>\r\n\r\n<p>- Ham học hỏi những kiến thức mới, chú trọng trau dồi chuyên môn Dược</p>\r\n\r\n<p>- Có khả năng viết bài content, nội dung sản phẩm Dược/ Sức khoẻ</p>\r\n\r\n<p>- Hiểu biết về Content SEO là 1 lợi thế</p>\r\n\r\n<p>- Chịu được áp lực trong công việc, Máu lửa và chăm chỉ</p>\r\n\r\n<h2>QUYỀN LỢI</h2>\r\n\r\n<p>- Làm việc tại tập đoàn bán lẻ hàng đầu Việt Nam</p>\r\n\r\n<p>- Văn hóa công ty khác biệt (5 Giá trị cốt lõi là trọng tâm)</p>\r\n\r\n<p>- Môi trường làm việc trẻ trung, năng động, trao quyền</p>\r\n\r\n<p>- Văn phòng trụ sở hiện đại, tiện nghi và thoải mái</p>\r\n\r\n<p>- Thưởng cuối năm hấp dẫn</p>', NULL, 'http://localhost:8000/uploads/files/web-5-03.jpg', NULL, NULL, 'nhan-vien-content-website-nha-thuoc-an-khang', 'Nhân viên Content website Nhà Thuốc An Khang', NULL, NULL, 'index,follow', 'index,follow', 'vi', 7, NULL, '2021-06-24 10:04:55', '2021-06-25 01:34:20'),
(8, '1fa34914-d429-47e8-aefe-aae12a3f6432', 'Cách tùy biến giao diện thanh taskbar Windows 11 trên Windows 10', 'Vũ Quốc Tuấn', NULL, '<p>Bên cạnh những tính năng mới, giao diện của thanh taskbar Windows 11 cũng được xem là một sự thay đổi đáng chú ý của hệ điều hành này. Mặc dù bản build dành cho nhà phát triển đã bị rò rỉ thời gian gần đây và có thể cài đặt khá dễ dàng. Tuy nhiên, trong bài viết này mình xin chia sẻ cách tùy biến giao diện thanh taskbar Windows 11 trên Windows 10, mời các bạn cùng tham khảo và làm thử nếu thấy thích nhé.</p>', '<p><b>B1:&nbsp;</b>Nhấp chuột phải vào thanh taskbar &gt; Bỏ chọn Lock the taskbar.<br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-1ebb7077d16c88d9e.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-1ebb7077d16c88d9e.jpg\" /><br />\r\n<br />\r\n<b>B2:&nbsp;</b>Nhấp chuột phải vào thanh taskbar &gt; Toolbar &gt; Chọn Links.<br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-2b5b4d33162412b55.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-2b5b4d33162412b55.jpg\" /><br />\r\n<br />\r\n<b>B3:&nbsp;</b>Bây giờ bạn sẽ thấy hai gạch kẻ đứng ở đầu (chứa các phím tắt ứng dụng thường dùng) và cuối thanh taskbar như hình minh họa.<br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-32d7a39f92d655545.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-32d7a39f92d655545.jpg\" /><br />\r\n<br />\r\n<b>B4:</b>&nbsp;Kéo gạch kẻ đầu tiên (chứa các phím tắt ứng dụng thường dùng) về phía các icon hệ thống ở góc bên phải màn hình để thay thế cho Links.<br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-4bb87829e5e70979a.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-4bb87829e5e70979a.jpg\" /><br />\r\n<br />\r\n<b>B5:</b>&nbsp;Tiếp tục căn chỉnh lại sao cho icon ứng dụng vào chính giữa màn hình từ thanh taskbar.<br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-52ba987406b603d38.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-52ba987406b603d38.jpg\" /><br />\r\n<br />\r\n<b>B6:</b>&nbsp;Sau khi cảm thấy ưng ý, bạn nhấp chuột phải vào thư mục trên thanh taskbar đã thêm vào trước đó, bỏ chọn Show text, Show Title và mở lại Lock the taskbar là xong.<br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-655abc38546cfce83.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-655abc38546cfce83.jpg\" /><br />\r\n<br />\r\nSau khi thực hiện xong các thao tác trên, bạn tải về&nbsp;<a href=\"https://www.techrum.vn/threads/m%E1%BB%9Di-t%E1%BA%A3i-v%E1%BB%81-h%C3%ACnh-n%E1%BB%81n-m%E1%BA%B7c-%C4%91%E1%BB%8Bnh-4k-tr%C3%AAn-windows-11-%C4%91%C6%B0%E1%BB%A3c-tr%C3%ADch-xu%E1%BA%A5t-t%E1%BB%AB-b%E1%BA%A3n-d%E1%BB%B1ng-%C4%91%E1%BA%A7u-ti%C3%AAn-b%E1%BB%8B-r%C3%B2-r%E1%BB%89.446954/\">hình nền Windows 11</a>&nbsp;và tùy chỉnh thêm phần Cá nhân hóa / Màu sắc trong Cài đặt hệ thống để giúp cho giao diện giống với phiên bản Windows này nhất có thể.</p>\r\n\r\n<ul>\r\n	<li data-xf-list-type=\"ul\">Cài đặt &gt; Tùy chỉnh Cá nhân hóa (Personalization) &gt; Taskbar &gt; Thiết lập mục Combine taskbar buttons thành \"Always, hide labels\"</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-752a87ef0c34011c6.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-752a87ef0c34011c6.jpg\" /></p>\r\n\r\n<ul>\r\n	<li data-xf-list-type=\"ul\">Cài đặt &gt; Colors (White, value 95%) &gt; Transparency effects (Off) &gt; Show accent color on the following surfaces (Chọn Start, taskbar, action center)</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-871394bb60e912bee.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-871394bb60e912bee.jpg\" /></p>', '<p><b>KẾT QUẢ:</b><br />\r\n<br />\r\n<img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-9db29e0c7ee55149a.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/taskbar-windows-11-style-on-windows-10-TECHRUM-9db29e0c7ee55149a.jpg\" /></p>', 'http://localhost:8000/uploads/files/taskbar-windows-11-style-on-windows-10-TECHRUm-cover07d6f6cfc2a25960.jpg', NULL, NULL, 'cach-tuy-bien-giao-dien-thanh-taskbar-windows-11-tren-windows-10', 'Cách tùy biến giao diện thanh taskbar Windows 11 trên Windows 10', NULL, NULL, 'index,follow', 'index,follow', 'vi', 8, NULL, '2021-06-24 10:08:06', '2021-06-25 01:34:36'),
(9, 'c59aa950-d7a2-4ea6-be54-d182d1d2483d', 'Tuyến cáp quảng biển AAE-1 lùi thời điểm bắt đầu sửa đến ngày 1/7', 'Vũ Quốc Tuấn', NULL, '<p>Theo dự kiến, thời điểm khắc phục sự cố tuyến cáp quang biển AAE-1 bắt đầu từ ngày 22/6 vừa qua, tuy nhiên kế hoạch này được lùi sang 1/7 và có thể sẽ hoàn thành vào ngày 7/7.</p>', '<p>AAE-1 (Asia Africa Europe 1) là một trong 5 tuyến cáp quang biển chiếm phần lớn dung lượng kết nối internet đi quốc tế từ Việt nam bên cạnh các tuyến khác như APG, AAG, IA hay SMW3. Tuy nhiên, AAE-1 chiếm vai trò quan trọng hơn với chất lượng nâng cao khi người dùng truy cập tới khu vực châu Âu, Trung Đông, đồng thời bổ sung cho hướng kết nối đi Hong Kong (Trung Quốc), Singapore trong trường hợp cần thiết.<br />\r\n<br />\r\nSự cố mà tuyến cáp biển này gặp phải bắt đầu từ ngày 25/5 trên nhánh FP10 của phân đoạn S1H.1, gần với mũi đất Cape D’Aguilar ở phía đông nam đảo Hồng Kông, Trung Quốc (cách khoảng 2.072 km hướng về phía bờ biển Vũng Tàu, Việt Nam). Theo thông tin đăng tải trên trang&nbsp;<a href=\"https://ictnews.vietnamnet.vn/cuoc-song-so/hai-tuan-nua-tuyen-cap-quang-bien-aae-1-duoc-sua-xong-288023.html\" rel=\"nofollow noopener\" target=\"_blank\">ICT News</a>, Nguyên nhân dẫn đến sự cố được xác định do đứt sợi, gây ra tình trạng gián đoạn một phần dịch vụ của các nhà mạng kết nối qua hướng Hong Kong (Trung Quốc) trên nhánh FP10.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/cap-bien-aae-1-TECHRUM-1b898b144a3e97d9b.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/cap-bien-aae-1-TECHRUM-1b898b144a3e97d9b.jpg\" />​</p>\r\n\r\n<p><br />\r\nBan đầu, kế hoạc sửa chữa khắc phục sự cố nhánh FP10 trên tuyến cáp AAE-1 được thông báo tới các nhà cung cấp dịch vụ mạng (ISP) tại Việt Nam, bắt đầu từ ngày 22/6 và hoàn thành vào ngày 13/7.<br />\r\n<br />\r\nTuy nhiên, thông tin mới nhất cập nhật từ đại diện một nhà cung cấp dịch vụ mạng trên tuyến AAE-1 thì thời điểm bắt đầu sửa chữa sẽ bị lùi lợi, dự kiến từ ngày 1/7 và hoàn thành vào ngày 7/7. Mặc dù thời gian khắc phục sự cố bị lùi lại 10 ngày so với dự kiến, nhưng thời gian hoàn thành lại nhanh hơn trước (sớm hơn 6 ngày).<br />\r\n<br />\r\nNhư vậy, ở thời điểm hiện tại các kết nối tới khu vực châu Âu, Trung Đông, Hong Kong (Trung Quốc), Singapore từ Việt Nam sẽ tiếp tục bị ảnh hưởng và được khôi phục hoàn toàn sau 2 tuần nữa theo dự kiến.</p>', NULL, 'http://localhost:8000/uploads/files/cap-bien-aae-1-TECHRUM-coverf0792af7112f36a4.jpg', NULL, NULL, 'tuyen-cap-quang-bien-aae-1-lui-thoi-diem-bat-dau-sua-den-ngay-17', 'Tuyến cáp quảng biển AAE-1 lùi thời điểm bắt đầu sửa đến ngày 1/7', NULL, NULL, 'index,follow', 'index,follow', 'vi', 9, NULL, '2021-06-24 10:09:03', '2021-06-25 01:34:51'),
(10, '460429e7-1350-4517-ada2-0d9a9545dbb1', 'Mô hình của iPhone 13 Series cho thấy cụm camera đặt chéo mới của iPhone 13 và iPhone 13 mini', 'Vũ Quốc Tuấn', NULL, '<p>Theo các báo cáo cho đến nay, Apple sẽ trình làng dòng sản phẩm iPhone 13 mới vào tháng 9 năm nay. Cũng giống như iPhone 12 Series, dòng sản phẩm mới này cũng sẽ có 4 phiên bản bao gồm: iPhone 13 mini, iPhone 13, iPhone 13 Pro và iPhone 13 Pro Max. Mặc dù vẫn còn vài tháng nữa trước khi ngày công bố diễn ra, nhưng ở thời điểm hiện tại đã có một số thông tin rò rỉ về thiết kế mặt sau của iPhone 13 và iPhone 13 mini.<br />\r\n&nbsp;</p>', '<p>Rò rỉ mới nhất đến từ Sonny Dickson, người thỉnh thoảng chia sẻ những thông tin rò rỉ quan trọng xung quanh các sản phẩm của Apple. Mới đây, Sonny Dickson đã chia sẻ một hình ảnh mô hình của bốn mẫu iPhone 13 Series. Như bạn có thể thấy, cả iPhone 13 mini và iPhone 13 đều có cách bố trí camera sau khác với iPhone 12 và iPhone 12 mini.<br />\r\n<br />\r\nMặc dù module camera kép phía sau của iPhone 13 và iPhone 13 mini mới sẽ tiếp tục có dạng hình vuông nhưng nó có hai thành phần bên trong. Các camera sẽ không được sắp xếp theo chiều dọc như iPhone 12, chúng sẽ được sắp xếp theo đường chéo. Hơn nữa, toàn bộ module camera có thiết kế mới để chứa các ống kính bên ngoài lớn hơn, tạo ra cảm ra camera lớn hơn so với iPhone 12 và 12 mini. Ngoài ra, iPhone 13 mini có vẻ dày hơn một chút so với iPhone 12 mini.<br />\r\n&nbsp;</p>\r\n\r\n<p><a href=\"https://twitter.com/i/web/status/1407651560054685701\" rel=\"external\" target=\"_blank\">&nbsp;https://twitter.com/i/web/status/1407651560054685701</a></p>\r\n\r\n<p><iframe allowfullscreen=\"true\" allowtransparency=\"true\" data-tweet-id=\"1407651560054685701\" frameborder=\"0\" id=\"twitter-widget-0\" scrolling=\"no\" src=\"https://platform.twitter.com/embed/Tweet.html?dnt=false&amp;embedId=twitter-widget-0&amp;features=eyJ0ZndfZXhwZXJpbWVudHNfY29va2llX2V4cGlyYXRpb24iOnsiYnVja2V0IjoxMjA5NjAwLCJ2ZXJzaW9uIjpudWxsfSwidGZ3X2hvcml6b25fdHdlZXRfZW1iZWRfOTU1NSI6eyJidWNrZXQiOiJodGUiLCJ2ZXJzaW9uIjpudWxsfSwidGZ3X3R3ZWV0X2VtYmVkX2NsaWNrYWJpbGl0eV8xMjEwMiI6eyJidWNrZXQiOiJjb250cm9sIiwidmVyc2lvbiI6bnVsbH19&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1407651560054685701&amp;lang=vi&amp;origin=https%3A%2F%2Fwww.techrum.vn%2Fthreads%2Fm%25C3%25B4-h%25C3%25ACnh-c%25E1%25BB%25A7a-iphone-13-series-cho-th%25E1%25BA%25A5y-c%25E1%25BB%25A5m-camera-%25C4%2591%25E1%25BA%25B7t-ch%25C3%25A9o-m%25E1%25BB%259Bi-c%25E1%25BB%25A7a-iphone-13-v%25C3%25A0-iphone-13-mini.449831%2F&amp;sessionId=59a91f7bbc51d65f8364c1aaba9a47d7f1968baf&amp;theme=light&amp;widgetsVersion=82e1070%3A1619632193066&amp;width=550px\" title=\"Twitter Tweet\"></iframe></p>\r\n\r\n<p><br />\r\nĐó là một sự khác biệt nhỏ có thể không được nhiều người chú ý, nhưng Apple luôn có cách để tạo ra những khác biệt, giúp khách hàng của họ biết được họ đang mua phiên bản nào mà không bị nhầm lẫn.<br />\r\n<br />\r\nTrong khi đó, iPhone 13 Pro trông giống hệt với người tiền nhiệm trực tiếp của nó, iPhone 12 Pro, nhưng Dickson đề cập rằng module camera chính của iPhone 13 Pro Max trông lớn hơn một chút. Có vẻ như anh ấy đang so sánh với module camera trên iPhone 12 Pro Max và điều này không có gì đáng ngạc nhiên khi từng có tin đồn trước đây cũng đã đề cập đến việc iPhone 13 Pro Max sẽ có module camera lớn hơn, ám chỉ rằng Apple có thể giới thiệu nhiều công nghệ mới vào phiên bản này.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/23/E4kPZ7lWUAMOxPc92aec1d18f0fa9f3.jpg\" src=\"https://photo.techrum.vn/images/2021/06/23/E4kPZ7lWUAMOxPc92aec1d18f0fa9f3.jpg\" />​</p>\r\n\r\n<p><br />\r\nMặc dù Dickson không tiết lộ mặt trước của bất kỳ mô hình iPhone 13 nào, nhưng các báo cáo trước đó đã đề cập rằng cả bốn mẫu đều có \"tai thỏ\" nhỏ hơn. Còn về thiết kế, Apple dự kiến sẽ giữ nguyên hình dạng cạnh phẳng cho toàn bộ dòng sản phẩm iPhone 13 mới của mình, với kích thước màn hình không khác gì so với iPhone 12 Series. Nói tóm lại, iPhone 13 Series sẽ chỉ là một bản nâng cấp của iPhone 12 Series.</p>', '<p>Nếu bạn đọc đang mong chờ mẫu iPhone có thiết kế hoàn toàn mới, bạn nên đợi đến cuối năm 2022, vì Apple được đồn đại là sẽ thử nghiệm một số mẫu iPhone 14 với màn hình kiểu đục lỗ. Hiện tại, những hình ảnh mô hình trên đây vẫn chỉ là tin đồn mà thôi, bạn đọc phải đợi đến mùa thu để biết được iPhone 13 Series mới sẽ như thế nào.</p>', 'http://localhost:8000/uploads/files/E4j7oKfVoAAJqkOfd1fff44e7f6a059.jpg', NULL, NULL, 'mo-hinh-cua-iphone-13-series-cho-thay-cum-camera-dat-cheo-moi-cua-iphone-13-va-iphone-13-mini', 'Mô hình của iPhone 13 Series cho thấy cụm camera đặt chéo mới của iPhone 13 và iPhone 13 mini', NULL, NULL, 'index,follow', 'index,follow', 'vi', 10, NULL, '2021-06-24 10:10:11', '2021-06-25 01:35:07'),
(11, 'e76f79c0-efbf-4532-97e3-8e7fc0d5c346', 'Nhà sáng lập McAfee, người được cho là đã tự sát, lại đăng bài viết lên Instagram như bình thường', 'Vũ Quốc Tuấn', NULL, '<p>Một trong những tin tức đáng chú ý trong sáng nay (24/6), bên cạnh kết quả \"bảng tử thần\" EURO 2020 thì tin tức về doanh nhân công nghệ người Mỹ gốc Anh John McAfee đã chết hôm qua (23/6, giờ châu Âu) do tự sát trong nhà tù ở Barcelona - Tây Ban Nha. Nhưng sự thật có phải như vậy?</p>', '<p>&nbsp;</p>\r\n\r\n<p>Theo đó, tờ Reuters cho biết luật sư Javier Villalba của ông John McAfee đã nói với tờ báo này rằng thân chủ của ông đã tự sát trong nhà tù ở thủ đô Barcelona sau khi tòa án tối cao Tây Ban Nha cho phép dẫn độ ông này sang Mỹ vì tội trốn thuế.<br />\r\n<br />\r\nLuật sư cũng cho biết rằng nhà tiên phong phần mềm chống virus này đã chết bằng cách treo cổ khi 9 tháng tù giam khiến ông tuyệt vọng. Trong một phiên tòa hồi tháng 5/2021, ông McAfee, 75 tuổi nói rằng với độ tuổi của mình thì ông sẽ ngồi tù phần đời còn lại nếu bị kết án ở Mỹ.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/image-140961338e8bde367.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/image-140961338e8bde367.jpg\" />​</p>\r\n\r\n<p><br />\r\n<i>\"Tôi hi vọng rằng tòa án Tây Ban Nha sẽ nhìn thấy sự bất công của việc này\"</i>, ông nói và cho biết thêm rằng&nbsp;<i>\"Mỹ muốn lấy tôi làm ví dụ\"</i>. Ông McAfee đã sống trong nhiều năm trốn tránh các cơ quan chức năng của Mỹ, một trong khoảng thời gian đó sống trên siêu du thuyền.<br />\r\n<br />\r\nÔng bị truy tố ở bang TN về tội trốn thuế và bị buộc tội trong một vụ gian lận tiền điện tử ở New York, NY. Ngoài ra, ông cũng là người tố cáo và chỉ trích chính phủ thế giới tham nhũng, điều vốn ít được các tờ báo quốc tế nhắc tới.<br />\r\n<br />\r\nMột nguồn tin từ cảnh sát Tây Ban Nha cho biết nhà sáng lập công nghệ này đã bị bắt giữ vào hồi 3/10/2020 tại sân bay Barcelona khi ông chuẩn bị đáp chuyến bay đến Istanbul với hộ chiếu Anh.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/image-3-cmpebcc15859d8ffcd6.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/image-3-cmpebcc15859d8ffcd6.jpg\" />​</p>\r\n\r\n<p><br />\r\nÔng McAfee từng làm việc cho NASA, Xerox và Lockheed Martin trước khi tung ra chương trình diệt vi rút thương mại đầu tiên trên thế giới vào năm 1987. Ông đã bán công ty phần mềm của mình cho Intel vào năm 2011 và không còn tham gia vào lĩnh vực kinh doanh nào nữa. Chương trình hiện vẫn mang tên ông và có 500 triệu người dùng trên toàn thế giới.<br />\r\n<br />\r\nTòa án cấp cao của Tây Ban Nha hôm qua (23/6) cho biết họ đồng ý dẫn độ ông McAfee sang Mỹ. Bộ tư pháp khu vực xác nhận rằng một người đàn ông Mỹ 75 tuổi đang chờ dẫn độ đã được tìm thấy đã chết trong phòng giam và nhà chức trách nhà tù đang điều tra nguyên nhân.<br />\r\n<br />\r\nMcAfee vẫn có cơ hội để kháng cáo bản án của mình nhưng không thể chịu thêm thời gian ngồi tù, ông Villalba nói.&nbsp;<i>\"Đây là kết quả của một hệ thống độc ác không có lí do gì để giữ người đàn ông này trong tù quá lâu\"</i>, ông nói.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/image-2aae1e638754519eb.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/image-2aae1e638754519eb.jpg\" />​</p>\r\n\r\n<p><br />\r\nCác công tố viên Mỹ có thể sẽ yêu cầu thẩm phán giám sát vụ trốn thuế bác bỏ cáo buộc vì cái chết của ông McAfee. Ông McAfee cho biết vào năm 2019 rằng ông đã không trả thuế thu nhập của Mỹ trong 8 năm vì lý do tư tưởng.<br />\r\n<br />\r\nCũng vào năm 2019, ông rời Mỹ để tránh bị xét xử và phần lớn sống trên siêu du thuyền cùng vợ, 4 con chó lớn, 2 nhân viên bảo vệ và 7 nhân viên khác. Ông cũng đề nghị giúp Cuba tránh lệnh cấm vận thương mại của Mỹ bằng cách sử dụng tiền điện tử và tìm cách tranh cử Tổng thống Mỹ cho Đảng Tự do.<br />\r\n<br />\r\nMcAfee là một người dùng Twitter nổi tiếng với hơn 1.1 triệu người theo dõi và các nền tảng mạng xã hội khác, trong đó có Instagram mà chúng ta sẽ đề cập ở phần dưới đây. Một số người ủng hộ tiền điện tử trên khắp thế giới sau khi biết sự việc đã đăng các dòng tweet chia buồn.<br />\r\n&nbsp;</p>\r\n\r\n<p><a href=\"https://twitter.com/i/web/status/1405918427663982594\" rel=\"external\" target=\"_blank\">&nbsp;https://twitter.com/i/web/status/1405918427663982594</a></p>\r\n\r\n<p><iframe allowfullscreen=\"true\" allowtransparency=\"true\" data-tweet-id=\"1405918427663982594\" frameborder=\"0\" id=\"twitter-widget-0\" scrolling=\"no\" src=\"https://platform.twitter.com/embed/Tweet.html?dnt=false&amp;embedId=twitter-widget-0&amp;features=eyJ0ZndfZXhwZXJpbWVudHNfY29va2llX2V4cGlyYXRpb24iOnsiYnVja2V0IjoxMjA5NjAwLCJ2ZXJzaW9uIjpudWxsfSwidGZ3X2hvcml6b25fdHdlZXRfZW1iZWRfOTU1NSI6eyJidWNrZXQiOiJodGUiLCJ2ZXJzaW9uIjpudWxsfSwidGZ3X3R3ZWV0X2VtYmVkX2NsaWNrYWJpbGl0eV8xMjEwMiI6eyJidWNrZXQiOiJjb250cm9sIiwidmVyc2lvbiI6bnVsbH19&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1405918427663982594&amp;lang=vi&amp;origin=https%3A%2F%2Fwww.techrum.vn%2Fthreads%2Fnh%25C3%25A0-s%25C3%25A1ng-l%25E1%25BA%25ADp-mcafee-ng%25C6%25B0%25E1%25BB%259Di-%25C4%2591%25C6%25B0%25E1%25BB%25A3c-cho-l%25C3%25A0-%25C4%2591%25C3%25A3-t%25E1%25BB%25B1-s%25C3%25A1t-l%25E1%25BA%25A1i-%25C4%2591%25C4%2583ng-b%25C3%25A0i-vi%25E1%25BA%25BFt-l%25C3%25AAn-instagram-nh%25C6%25B0-b%25C3%25ACnh-th%25C6%25B0%25E1%25BB%259Dng.449975%2F&amp;sessionId=4d39530e3347d8ac4c5802fd9041da45ee2f556c&amp;theme=light&amp;widgetsVersion=82e1070%3A1619632193066&amp;width=550px\" title=\"Twitter Tweet\"></iframe></p>\r\n\r\n<p><br />\r\nTrong dòng tweet công khai cuối cùng của mình hôm 18/6, ông McAfee đã viết rằng:<br />\r\n&nbsp;</p>\r\n\r\n<p><i>\"Trong một nền dân chủ, quyền lực được trao không được thực hiện.</i>​</p>\r\n\r\n<p>​</p>\r\n\r\n<p><i>Nhưng nó vẫn là sức mạnh.</i>​</p>\r\n\r\n<p>​</p>\r\n\r\n<p><i>Tình yêu thương, lòng trắc ẩn, sự quan tâm không có ích lợi gì. Nhưng nó là nhiên liệu cho sự tham lam, thù địch, ghen tị....</i>​</p>\r\n\r\n<p>​</p>\r\n\r\n<p><i>Tất cả các sức mạnh đều hủ bại.</i>​</p>\r\n\r\n<p>​</p>\r\n\r\n<p><i>Hãy quan tâm đến quyền hạn nào bạn cho phép một nền dân chủ sử dụng\"</i>.​</p>\r\n\r\n<p><br />\r\nTuy nhiên, sự thật có phải là ông John McAfee là đã chết? Có lẽ là không, dẫn theo nguồn tin thân cận mà mình có được khi cái chết này được xem là cờ giả.<br />\r\n<br />\r\nTrong diễn biến liên quan, tài khoản Instagram của ông lại đăng bài lên Instagram với ảnh của chữ Q, vốn liên quan đến cái gọi là \"thuyết âm mưu QAnon\".<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/Web-cap-insta6a01ed036ebe7631.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/Web-cap-insta6a01ed036ebe7631.jpg\" />​</p>\r\n\r\n<p><br />\r\nBài đăng này được đăng lên ngay sau khi báo chí quốc tế đưa tin ông đã chết trong tù ở Tây Ban Nha. Còn về cái gọi \"thuyết âm mưu QAnon\" khi được nổi lên dưới nhiệm kì của cựu Tổng thống Mỹ Donald J.Trump tại Nhà Trắng, khi cho rằng ông đang tiến hành cuộc chiến bí mật chống lại một nhóm ấu dâm Dân chủ ăn thịt đồng loại, tôn thờ quỷ Satan.<br />\r\n<br />\r\nThuyết này đã tìm thấy những người tin tưởng trong một bộ phận khá lớn cơ sở người hâm mộ của cựu tổng thống trong suốt cuộc bầu cử năm 2020 và vẫn còn phổ biến cho đến hiện tại.<br />\r\n<br />\r\nNhưng có điều khá thú vị và trớ trêu thay, có những điều trong cái gọi là \"thuyết âm mưu\" do chính CIA sáng tạo nên 3 chữ đó lại hoàn toàn là sự thật (như kiểm phiếu bầu lại ở bang AZ), khi hoàn toàn trùng khớp với các con số và mã lệnh được ghi trên đó.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/image-4660395fb71601183.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/image-4660395fb71601183.jpg\" />​</p>\r\n\r\n<p><br />\r\nNhững người ủng hộ thuyết âm mưu QAnon đã được nhìn thấy trong số những người ủng hộ ông Trump, những người đã xông vào Điện Capitol của Mỹ hồi tháng 1/2021 trong nỗ lực chặn chứng nhận thất bại trong cuộc bầu cử của ông.<br />\r\n<br />\r\nNhưng thực tế rằng là sau khi điều tra lại thì có nhiều bằng chứng cho thấy họ chỉ là số ít còn phần lớn áp đảo số đông nhiều nhất là các nhóm Antifa, BLM,.... và cuộc bạo động này được thao túng bởi Đảng Dân chủ.<br />\r\n<br />\r\nTuy nhiên, bài viết này đã bị gỡ bỏ lúc 9:45 GMT+7 24/6 sau một thời gian tồn tại. Bản thân ông McAfee không xa lạ gì với các thuyết âm mưu khi ông đề cập khá nhiều từ năm 2018.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://www.techrum.vn/chevereto/images/2016/03/02/12784471_462378757287023_469694906_n.jpg\" src=\"https://www.techrum.vn/chevereto/images/2016/03/02/12784471_462378757287023_469694906_n.jpg\" />​</p>', '<p>Tài khoản Instagram của ông vào năm 2019 đã đăng ảnh ông cầm súng đứng trước che chở ông Jeffrey Epstein, một triệu phú và tội phạm tình dục đã bị kết án được cho là đã chết trong phòng giam ở Manhattan cùng trong năm 2019, khi các nhà chức trách cũng cho là đã tự tử.</p>\r\n\r\n<p>​</p>\r\n\r\n<p><i>\"Tôi chưa bao giờ nói Jeffrey Epstein đã bị sát hại. Tôi nói ông ấy không tự tử. Không giống nhau. Có thể còn sống. Có thể đã không bao giờ tồn tại. Có thể bị sát hại. Tôi không biết. Tôi chỉ biết ông ấy không tự tử\"</i>, ông McAfee ghi chú thích cho tấm ảnh đó.</p>', 'http://localhost:8000/uploads/files/cvrd06fab39950b8f65.jpg', NULL, NULL, 'nha-sang-lap-mcafee-nguoi-duoc-cho-la-da-tu-sat-lai-dang-bai-viet-len-instagram-nhu-binh-thuong', 'Nhà sáng lập McAfee, người được cho là đã tự sát, lại đăng bài viết lên Instagram như bình thường', NULL, NULL, 'index,follow', 'index,follow', 'vi', 11, NULL, '2021-06-24 10:12:52', '2021-06-25 01:35:24'),
(12, 'abe5aa1f-bbfd-4a80-aea1-bb2161f418ba', 'Galaxy A22 ra mắt: Camera OIS, màn hình 90Hz, pin 5.000mAh, giá từ 5tr890', 'Vũ Quốc Tuấn', NULL, '<p>Galaxy A22 LTE là mẫu smartphone với bộ 4 Camera với công nghệ tiên phong Chống rung quang học (OIS). Phiên bản Galaxy A22 5G sở hữu công nghệ 5G tiên tiến, mang đến ưu thế tốc độ. Bên cạnh đó, bộ đôi smartphone này còn được trang bị tần số quét màn hình 90Hz cao cấp nhất, kết hợp với vi xử lý 8 nhân và dung lượng pin bền bỉ, mở ra không gian giải trí sống động, hiệu năng mạnh mẽ suốt ngày dài năng động.</p>', '<p><b>BỘ 4 CAMERA CHỤP QUAY SẮC NÉT</b><br />\r\n<br />\r\nGalaxy A22 LTE sở hữu Camera đột phá tích hợp Công Nghệ Chống Rung Quang Học OIS đầu tiên trong phân khúc dưới 6 triệu đồng. Chiếc smartphone này hứa hẹn thỏa mãn sức sáng tạo nội dung chụp ảnh quay phim mượt mà, ổn định khung hình, giảm thiểu rung lắc hay nhòe hình, kể cả trong tình huống di chuyển hay thiếu sáng. Giờ đây, người dùng có thể tạm biệt những bức ảnh và video mờ nhòe, thỏa sức nắm bắt những khoảnh khắc đầy ý nghĩa, lướt qua trong cuộc sống và chia sẻ chúng lên mạng xã hội ngay tức thì.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/NO.27_WTP9137-684x1024a291d195636b5232.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/NO.27_WTP9137-684x1024a291d195636b5232.jpg\" />​</p>\r\n\r\n<p><br />\r\nVới cụm 4 Camera 48MP ưu việt ở mặt lưng dẫn đầu trong phân khúc, Galaxy A22 LTE vừa mang lại hình ảnh chất lượng cao, vừa sắc nét chân thật trong mọi chế độ. Người dùng có thể ghi lại những khoảnh khắc đáng nhớ của mình theo bốn kết quả hiển thị đặc trưng khác nhau. Camera Chụp Góc Siêu Rộng 8MP cho phép mở rộng khung hình ấn tượng lên đến 123 độ, tương tự như thị giác của con người, giúp người dùng ghi lại cả thế giới một cách chân thật như mắt nhìn. Bên cạnh đó, người dùng còn dễ dàng tùy chỉnh tiêu cự để tập trung vào chủ thể, tối ưu khả năng lấy nét nhờ vào Camera Xóa Phông 2MP cho hình ảnh nổi bật và có chiều sâu. Galaxy A22 LTE còn sở hữu Camera Marco với công nghệ chụp cận cảnh 2MP cho phép người dùng lấy nét ở khoảng cách chỉ từ 3-5cm, bắt trọn vẻ đẹp chi tiết của thế giới siêu nhỏ và đem đến hình ảnh nghệ thuật sáng tạo mang đậm dấu ấn cá nhân.<br />\r\n<br />\r\nNgoài ra, Camera Selfie trước 13MP hỗ trợ chụp Chân Dung sẽ mang lại cho người dùng nhiều bộ ảnh Selfie đẹp lung linh nhờ khả năng lấy nét chủ thể tốt và có thể kết hợp làm mờ phông nền. Kết hợp cùng nhiều bộ lọc tự động có sẵn trên máy, Galaxy A22 mang đến những tác phẩm mang nhiều màu sắc nghệ thuật khác nhau, thích hợp với tính cách đa dạng của giới trẻ thế hệ Z. Bên cạnh đó, nhiều tính năng hỗ trợ thú vị như chèn Live Sticker Cảm Xúc vào khung hình, Tự Động Làm Đẹp Thông Minh (Smart beauty) chắc chắn sẽ khiến người dùng, đặc biệt là người dùng trẻ thích thú và muốn chia sẻ ngay lên mạng xã hội.<br />\r\n<br />\r\n<b>Màn hình 90Hz, hiệu năng mạnh mẽ</b><br />\r\n<br />\r\nBộ đôi Galaxy A22 LTE và A22 5G được trang bị màn hình với tần số quét lên tới 90Hz cao cấp nhất, mang lại khả năng hiển thị mượt mà từng chi tiết trong từng khung hình. Bên cạnh đó, Galaxy A22 LTE nhờ sở hữu màn hình tràn viền vô cực Super AMOLED 6.4 inch tiên tiến bậc nhất phân khúc, với độ sáng lên tới 600nit cho phép người dùng có thể dễ dàng sử dụng ngay cả dưới điều kiện ánh nắng gay gắt của mùa hè. Một mặt khác, đối với phiên bản Galaxy A22 5G, màn hình có nâng cấp nhỉnh hơn với kích thước tràn viền vô cực lên đến 6.6 inch Full HD+ giúp nội dung được hiển thị một cách sống động và sắc nét dù cho người dùng đang xem phim hay nhập vai trong game.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/SM_A225_GalaxyA22_Black_Front362b16e0bf07294a.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/SM_A225_GalaxyA22_Black_Front362b16e0bf07294a.jpg\" />​</p>\r\n\r\n<p><br />\r\nĐể tận dụng màn hình 90Hz, Samsung đã trang bị cho bộ đôi Galaxy A22 LTE và A22 5G cấu hình với bộ vi xử lí tám nhân mạnh mẽ, xung nhịp tối đa lần lượt là 2.0GHz và 2.2GHz, kết hợp với 6GB RAM và 128GB bộ nhớ trong hỗ trợ thẻ nhớ lên tới 1TB, sẵn sàng phục vụ mọi nhu cầu trải nghiệm học tập, hay xem clip giải trí, và đặc biệt tối ưu cho việc chơi game trên smartphone hằng ngày nhờ sở hữu dung lượng pin lên tới 5.000mAh với thời lượng sử dụng lên đến hai ngày cùng công nghệ sạc nhanh 15W.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/SS-A22-KV-732x10244b994764d3fc2973.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/SS-A22-KV-732x10244b994764d3fc2973.jpg\" />​</p>\r\n\r\n<p><br />\r\nBộ đôi Galaxy A22 LTE và Galaxy A22 5G còn nổi bật hơn với thiết kế trẻ trung, bật phong cách sống của người dùng trẻ nhờ vào thiết kế cụm camera độc đáo của dòng Galaxy A với ba gam màu đầy cá tính gồm Xanh Mint, Tím Unicorn và Đen Diamond.<br />\r\n<br />\r\n<b>KẾT NỐI 5G</b><br />\r\n<br />\r\nGalaxy A22 5G được trang bị công nghệ 5G đầu tiên trong phân khúc, thay đổi cách người dùng trải nghiệm và chia sẻ nội dung từ chơi game, phát trực tuyến (livestream) đạt chất lượng mượt mà, cho đến việc chia sẻ và tải mọi dữ liệu xuống máy cực nhanh.<br />\r\n<br />\r\nChính vì sự tập trung vào kết nối 5G nên Galaxy A22 5G có phần khác biệt khi trang bị bộ 3 Camera linh hoạt ở mặt lưng nhưng vẫn dễ dàng chinh phục mọi nhu cầu sử dụng hằng ngày. Người dùng có thể nắm bắt trọn vẹn khoảnh khắc độc đáo của thế giới xung quanh với Camera chính 48MP giúp lấy nét chân thật bậc nhất, Camera siêu rộng 5MP có tầm phủ 115 độ và Camera xóa phông nền 2MP.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/A22_PROMO-819x1024de2d545c2eae5e90.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/A22_PROMO-819x1024de2d545c2eae5e90.jpg\" /></p>', '<p>Galaxy A22 LTE sẽ chính thức lên kệ tại Việt Nam tại các hệ thống bán lẻ trên toàn quốc với giá bán lẻ đề nghị là 5,890,000 đồng kể từ ngày 24/06/2021. Riêng đối với Galaxy A22 phiên bản 5G, Samsung sẽ sớm cho ra mắt trong thời gian sắp tới. Đặc biệt, người dùng mua sản phẩm Galaxy A22 LTE từ ngày 24/6/2021 đến 31/7/2021 sẽ nhận được ưu đãi giảm giá hấp dẫn đến 580,000 đồng trên ứng dụng quà tặng Galaxy Gift.</p>', 'http://localhost:8000/uploads/files/Hoang-Duyen_mint59d1addbe02d1329.jpg', NULL, NULL, 'galaxy-a22-ra-mat-camera-ois-man-hinh-90hz-pin-5000mah-gia-tu-5tr890', 'Galaxy A22 ra mắt: Camera OIS, màn hình 90Hz, pin 5.000mAh, giá từ 5tr890', NULL, NULL, 'index,follow', 'index,follow', 'vi', 12, NULL, '2021-06-24 10:13:51', '2021-06-25 01:35:45');
