(13, 'af6acb31-74b4-4aa5-9cf0-fa370e7bba57', 'Khảo sát cho thấy, 50% người dùng iPhone, iPad không hài lòng, thất vọng với iOS 15 và iPadOS 15 mới', 'Vũ Quốc Tuấn', NULL, '<p>iOS 15 và iPadOS 15 đã chính thức được Apple công bố tại sự kiện WWDC 2021 vừa qua. Mặc dù mang đến những cải tiến lớn trong các ứng dụng hệ thống như Face ID, Messenger,v.v...tuy nhiên có vẻ như iOS 15 và iPadOS 15 không đạt được sự kỳ vọng của cộng đồng người dùng iPhone lẫn iPad.</p>', '<p>Cụ thể theo dữ liệu của một cuộc khảo sát gần đây của SellCell cho thấy người dùng iPhone, iPad dường như không quan tâm đến sự ra mắt iOS 15 và iPadOS15 mới của Apple tại sự kiện WWDC 2021 vừa qua. Cuộc khảo sát đã hỏi 3.000 người dùng iPhone và iPad từ 18 tuổi trở lên (50% đối với nam và nữ), về quan điểm của họ đối với iOS 15 cũng như iPadOS15. Kết quả cho thấy hơn 50% số người được hỏi cho rằng iOS 15 và iPadOS15 bản cập nhật chỉ là \"nhỏ\" hoặc \"không hề\" thú vị. 28,1% khác cho rằng những cập nhật này “hơi thú vị”. Và chỉ có 19,3% “rất hài lòng” về phiên bản iOS, iPadOS mới này.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/23/ios1560e05db06364aa3e.jpg\" src=\"https://photo.techrum.vn/images/2021/06/23/ios1560e05db06364aa3e.jpg\" />​</p>\r\n\r\n<p><br />\r\nTheo đó, trong iOS 15 và iPadOS15, 23% người dùng cho biết nâng cấp thú vị nhất là việc Apple tích hợp ID card vào ứng dụng Wallet. 17,3% hào hứng nhất với tìm kiếm Spotlight được nâng cao và 14,2% hào hứng nhất với các tính năng Find My mới.<br />\r\n<br />\r\nRất ít người được hỏi cho biết họ hứng thú với nhiều tính năng mới của ‌iOS 15‌ và ‌iPadOS15‌. Ít hơn 1% số người được hỏi cho rằng tính năng \"Shared with You\" trong iMessage, các nâng cấp ứng dụng Health, cải tiến đối với Apple Maps,v.v....mà Apple tập trung quảng bá tại WWDC 2021 là hữu dụng đối với họ. Tương tự như vậy, các cải tiến ứng dụng FaceTime với Spatial Audio chia sẻ màn hình, chế độ xem lưới và chế độ dọc, hệ thống thông báo được thiết kế lại đều không được người dùng iPhone và iPad không quan tâm.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/23/ipados-15-gets-widgets-on-the-home-screen-app-library-and-better-multitasking5eda56607c59ae80.jpg\" src=\"https://photo.techrum.vn/images/2021/06/23/ipados-15-gets-widgets-on-the-home-screen-app-library-and-better-multitasking5eda56607c59ae80.jpg\" />​</p>\r\n\r\n<p><br />\r\nKhi được hỏi những tính năng nào mà người trả lời cho rằng nên được thêm vào trong ‌iOS 15‌ và ‌iPadOS15‌ thì có tới 32,3% nói rằng đáng lẽ phải có các widgets mới 21% nói rằng đáng lẽ phải có tính năng Always On Display như Android, 14,9% nói rằng đáng lẽ phải có phiên bản Pro của các ứng dụng Xcode hoặc Final Cut Pro dành cho ‌iPad‌ và 13,2% nói rằng đáng lẽ phải có hỗ trợ hiển thị màn hình bên ngoài tốt hơn cho ‌iPad‌.</p>', '<p>Ngoài các bản cập nhật ‌iOS 15‌ và ‌iPadOS15‌, cuộc khảo sát cũng điều tra về một nỗi sợ mê tín về số 13, xung quanh việc đặt tên cho ‌iPhone 13‌ sắp tới. Có tới 1/5 người dùng ‌iPhone‌ và ‌iPad‌ cho biết rằng họ sẽ bị không thích Apple đặt tên cho thế hệ iPhone sắp tới là iPhone 13. Những người được hỏi cũng được hỏi rằng họ nghĩ Apple nên đặt tên cho loạt mẫu ‌iPhone‌ sắp tới của mình như thế nào. Điều thú vị là hầu hết các phản hồi đều chỉ ra rằng thiết bị không nên được gọi là \"‌iPhone 13‌\". 38% cho rằng Apple nên gọi thế hệ iPhone mới là \"‌iPhone‌ (2021)\", 26% cho rằng \"‌iPhone 13‌\" là cái tên hay nhất và chỉ 13% nói rằng Apple nên đặt tên là \"‌iPhone‌ 12S\".<br />\r\n&nbsp;</p>', 'http://localhost:8000/uploads/files/iOS-14-guide-Heres-how-to-change-the-icons-on-your-iPhone-18a940c89a241eba2.jpg', NULL, NULL, 'khao-sat-cho-thay-50-nguoi-dung-iphone-ipad-khong-hai-long-that-vong-voi-ios-15-va-ipados-15-moi', 'Khảo sát cho thấy, 50% người dùng iPhone, iPad không hài lòng, thất vọng với iOS 15 và iPadOS 15 mới', NULL, NULL, 'index,follow', 'index,follow', 'vi', 13, NULL, '2021-06-24 10:14:38', '2021-06-25 01:36:03'),
(14, 'b9e1652c-2eaa-4bad-a65b-087d85f2e581', 'Alan Turing: Chuyên gia mật mã hàng đầu đã cứu thế giới khỏi chiến tranh và cái chết tức tưởi', 'Vũ Quốc Tuấn', NULL, '<p>Alan Turing là thiên tài toán học người Anh, đã lãnh đạo các cộng sự của mình phá vỡ loạt thông tin được mã hóa quan trọng của quân đội phát xít và góp phần đem lại chiến thắng quan trong cho phe Đồng minh trong thế chiến thứ 2. Dù vậy, với khuynh hướng giới tính của mình, ông đã bị xã hội lúc bấy giờ kỳ thị nặng nề và đã tự kết liễu mình bằng xyanua khi mới 41 tuổi.</p>', '<p>Turing sinh ngày 23/06/1912 tại London, Anh. Năm 22 tuổi, ông tốt nghiệp đại học Cambridge danh giá. Khi thế chiến thứ 2 nổ ra, ông làm việc cho chính phủ Anh và được giao nhiệm vụ phát triển \"Bombe\"- loại thiết bị phá mật mã.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/Alan-Turingb8f3ad1888cf90d5.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/Alan-Turingb8f3ad1888cf90d5.jpg\" />​</p>\r\n\r\n<p><br />\r\nLúc này, phe Đồng Minh bắt được rất nhiều thông điệp mà người Đức truyền cho nhau nhưng họ không cách nào hiểu được vì chúng đã được quân đội Đức mã hóa kỹ càng. Bombe chính là hy vọng để người Anh hiểu được các tướng Đức điều binh như thế nào.<br />\r\n<br />\r\nTuring được xem là cha đẻ của khoa học máy tính và trí thông minh nhân tạo. Máy Bombe có thể xử lý và giải các mật mã rất nhanh với độ chính xác cao. Người ta từng ghi nhận nó có thể giải đến 89,000 thông điệp mỗi ngày. Nhờ các thông tin quý giá này mà nước Anh nói riêng và phe Đồng Minh nói chung đã tránh được vô số các trận chiến đẫm máu.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/210623-turing-bombe-ew-1020a-3b49dd1c7f624c169960c8.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/210623-turing-bombe-ew-1020a-3b49dd1c7f624c169960c8.jpg\" />​</p>\r\n\r\n<p><br />\r\nKết thúc chiến tranh, Turing được vua George VI của Anh quốc ghi nhận công trạng bằng những tước hiệu cao quý. Ông vẫn tiếp tục làm việc trong ngành khoa học máy tính và đã tạo ra engine máy tính tự động (ACE- Automatic computing engine). Đây được xem là chiếc máy tính đầu tiên trong thời kỳ này. Các đồng nghiệp của Turing cho rằng máy có thiết kế quá cồng kềnh và đã nỗ lực để thu nhỏ kích thước sản phẩm. Sau đó, đại học Manchester đã thành công và Turing trở thành Phó Giám đốc cho dự án này. Ông cũng là người lập trình cho máy.<br />\r\n<br />\r\nDù góp công to lớn trong cuộc chiến tranh thế giới lần 2 và có nhiều đóng góp quan trọng cho ngành khoa học sau đó, Turing vẫn là nạn nhân của nạn kỳ thị giới tính. Trong thập niên 50 của thế kỷ trước tại Anh, những người đồng tính và lưỡng tính bị săn lùng gắt gao và bị xem như tội phạm. Turing cũng không phải ngoại lệ.<br />\r\n<br />\r\nThàng 1/1952, Turing bị khởi tố vì \"hành vi không đứng đắn\" với một người đàn ông khác tại Manchester. Dù là \"tài sản quốc gia\" và là người lãnh đạo của Phòng giải mã thuộc Sở Thông tin Chính phủ, Turing vẫn bị tuyên là có tội.<br />\r\n<br />\r\nTháng 3 năm đó, Turing nhận tội. Để không chịu án tù, ông chấp nhận hình thức thiến hóa học- chịu tiêm hormone để giảm ham muốn tình dục của mình.<br />\r\n<br />\r\nViệc có tiền án khiến ông mất việc tại cơ quan tình bảo của chính phủ. Bị ghét bỏ và bị tước các quyền công dân, Turning tự sát bằng thuốc độc xyanua ngày 8/6/1954, khi chỉ còn 2 tuần nữa là đến sinh nhật thứ 42.<br />\r\n<br />\r\n13 năm sau, vào ngày 14/6/1967, luật phát của Anh mới không còn xem những người đồng tính là tội phạm.<br />\r\n<br />\r\nDù vậy, Turing vẫn được xem là một nhà khoa học lỗi lạc của nhân loại. Năm 2009, Thủ tướng Anh lúc đó là Gordon Brown thay mặt chính phủ Anh đã lên tiếng xin lỗi Turing vì những đối xử bất công dành cho ông. Năm 2013, Nữ hoàng Elizabeth II xá tội cho Turing.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/24/210623-alan-turing-50-pound-note-ew-1026a-57efb5913928e0dbb14467.jpg\" src=\"https://photo.techrum.vn/images/2021/06/24/210623-alan-turing-50-pound-note-ew-1026a-57efb5913928e0dbb14467.jpg\" />​</p>\r\n\r\n<p><br />\r\nNhân ngày sinh thứ 109 của Alan Turing, hôm qua ngân hàng Anh đã phát hành tờ 50 bảng với hình ảnh của ông. Đây được xem là sự vinh danh cho một nhà khoa học đã chịu nhiều bất công và phải chọn cái chết khi còn quá trẻ. Đây cũng là lần đầu tiên một người đồng tính xuất hiện trên tờ bạc của Anh, và đồng tiền này cũng được phát hành trong tháng 6- Tháng tự hào của cộng đồng LGBTQ+.</p>', '<p>Năm 2014, bộ phim The Imitation Game đã khắc họa lại cuộc đời của Alan Turing với Bennedict Cumberbatch đóng chính, thu về 233 triệu đô trên toàn cầu, dù chi phí sản xuất chỉ có 14 triệu đô. The Imitation cũng đạt Oscar cho Kịch bản chuyển thể hay nhất.<br />\r\n&nbsp;</p>', 'http://localhost:8000/uploads/files/turing-2-13a8d772e60b9f7d4.jpg', NULL, NULL, 'alan-turing-chuyen-gia-mat-ma-hang-dau-da-cuu-the-gioi-khoi-chien-tranh-va-cai-chet-tuc-tuoi', 'Alan Turing: Chuyên gia mật mã hàng đầu đã cứu thế giới khỏi chiến tranh và cái chết tức tưởi', NULL, NULL, 'index,follow', 'index,follow', 'vi', 14, NULL, '2021-06-24 10:15:34', '2021-06-25 01:36:20'),
(15, '2eb0a4c9-4337-43d7-aee2-38f9d70ed90a', 'Bizfly - Trọn bộ giải pháp Chuyển đổi số từ \"gốc đến ngọn\" cho doanh nghiệp', 'Vũ Quốc Tuấn', NULL, '<p>Gần đây khi đại dịch dần được khống chế tại nhiều quốc gia trên thế giới đã tạo lực cầu lớn, giúp thị trường xuất khẩu của nhiều doanh nghiệp trong các ngành hàng nông, thủy sản, gỗ… tăng trưởng mạnh hơn. Tuy nhiên theo giới chuyên gia, vấn đề cần quan tâm của doanh nghiệp lúc này đó là làm sao “nâng chất” cho sản phẩm để các đối tác yên tâm, tin tưởng, từ đó giúp doanh nghiệp tận dụng tốt cơ hội hậu Covid.</p>', '<p>Thông tin từ các hiệp hội thủy sản, nông sản, gỗ… cho biết, kể từ tháng 4/2021 tới nay, giá trị xuất khẩu hàng Việt đi các thị trường đã tăng mạnh trở lại, đặc biệt là tại thị trường Mỹ, EU. Đơn cử với thủy sản, Hiệp hội Chế biến và Xuất khẩu thủy sản Việt Nam (VASEP) cho hay, xuất khẩu tôm sang Mỹ 5 tháng đầu năm đạt 270 triệu USD, tăng 21% so với cùng kỳ; với cá tra cũng đang trên đà phục hồi khi đạt mức tăng 136% trong tháng 4 và tăng khoảng 200% trong tháng 5, đạt 33 triệu USD, đưa kết quả 5 tháng đầu năm 2021 lên 135 triệu USD, tăng 57% so với cùng kỳ. Cùng với Mỹ, xuất khẩu thủy sản Việt Nam sang EU tháng 5 tiếp tục tăng 30%, đạt gần 95 triệu USD, sau khi tăng mạnh 36% trong tháng 4 với 97 triệu USD. Lũy kế xuất khẩu 5 tháng đầu năm sang EU đạt trên 380 triệu USD, tăng 15% so với cùng kỳ năm ngoái.</p>', NULL, 'http://localhost:8000/uploads/files/5414_hinh_ca_tra__3.jpg', NULL, NULL, 'bizfly-tron-bo-giai-phap-chuyen-doi-so-tu-goc-den-ngon-cho-doanh-nghiep', 'Bizfly - Trọn bộ giải pháp Chuyển đổi số từ \"gốc đến ngọn\" cho doanh nghiệp', NULL, NULL, 'index,follow', 'index,follow', 'vi', 15, NULL, '2021-06-25 01:42:52', '2021-06-25 01:42:52'),
(16, '54310dad-966f-4fcd-864d-fe38aed3474d', 'Cách nào để xuất khẩu hàng Việt đón đầu xu thế hậu Covid-19?', 'Vũ Quốc Tuấn', NULL, '<p>Gần đây khi đại dịch dần được khống chế tại nhiều quốc gia trên thế giới đã tạo lực cầu lớn, giúp thị trường xuất khẩu của nhiều doanh nghiệp trong các ngành hàng nông, thủy sản, gỗ… tăng trưởng mạnh hơn. Tuy nhiên theo giới chuyên gia, vấn đề cần quan tâm của doanh nghiệp lúc này đó là làm sao “nâng chất” cho sản phẩm để các đối tác yên tâm, tin tưởng, từ đó giúp doanh nghiệp tận dụng tốt cơ hội hậu Covid.</p>', '<p>Thông tin từ các hiệp hội thủy sản, nông sản, gỗ… cho biết, kể từ tháng 4/2021 tới nay, giá trị xuất khẩu hàng Việt đi các thị trường đã tăng mạnh trở lại, đặc biệt là tại thị trường Mỹ, EU. Đơn cử với thủy sản, Hiệp hội Chế biến và Xuất khẩu thủy sản Việt Nam (VASEP) cho hay, xuất khẩu tôm sang Mỹ 5 tháng đầu năm đạt 270 triệu USD, tăng 21% so với cùng kỳ; với cá tra cũng đang trên đà phục hồi khi đạt mức tăng 136% trong tháng 4 và tăng khoảng 200% trong tháng 5, đạt 33 triệu USD, đưa kết quả 5 tháng đầu năm 2021 lên 135 triệu USD, tăng 57% so với cùng kỳ. Cùng với Mỹ, xuất khẩu thủy sản Việt Nam sang EU tháng 5 tiếp tục tăng 30%, đạt gần 95 triệu USD, sau khi tăng mạnh 36% trong tháng 4 với 97 triệu USD. Lũy kế xuất khẩu 5 tháng đầu năm sang EU đạt trên 380 triệu USD, tăng 15% so với cùng kỳ năm ngoái.</p>', NULL, 'http://localhost:8000/uploads/files/about-img1.jpg', NULL, NULL, 'cach-nao-de-xuat-khau-hang-viet-don-dau-xu-the-hau-covid-19', 'Cách nào để xuất khẩu hàng Việt đón đầu xu thế hậu Covid-19?', NULL, NULL, 'index,follow', 'index,follow', 'vi', 16, NULL, '2021-06-25 01:43:36', '2021-06-25 01:43:36'),
(17, 'cfea8889-215e-4af5-9143-d8618c99b788', 'Hàn Quốc tăng nhập khẩu đồ nội thất bằng gỗ từ thị trường Việt Nam', 'Vũ Quốc Tuấn', NULL, '<article>\r\n<p>Trong 5 tháng đầu năm 2021, kim ngạch xuất khẩu gỗ và sản phẩm gỗ sang thị trường Hàn Quốc đạt 369,2 triệu USD, tăng 7% so với cùng kỳ năm 2020. Xu hướng tiêu thụ đồ nội thất bằng gỗ của Hàn Quốc vẫn tăng trưởng khả quan, sẽ là cơ hội cho các doanh nghiệp xuất khẩu đồ nội thất bằng gỗ của Việt Nam.</p>\r\n</article>', '<p>Theo số liệu từ Tổng cục Hải quan, kim ngạch xuất khẩu gỗ và sản phẩm gỗ của Việt Nam sang Hàn Quốc trong 5 tháng đầu năm 2021 đạt 369,2 triệu USD, tăng 7% so với cùng kỳ năm 2020. Gỗ, ván và ván sàn xuất khẩu sang thị trường Hàn Quốc chiếm tỷ trọng cao nhất trong cơ cấu mặt hàng gỗ và sản phẩm gỗ xuất khẩu trong 4 tháng đầu năm 2021, đạt 98 triệu USD, tăng 0,6% so với cùng kỳ năm 2020.</p>', NULL, 'http://localhost:8000/uploads/files/3146_xuat-khau-go.jpg', NULL, NULL, 'han-quoc-tang-nhap-khau-do-noi-that-bang-go-tu-thi-truong-viet-nam', 'Hàn Quốc tăng nhập khẩu đồ nội thất bằng gỗ từ thị trường Việt Nam', NULL, NULL, 'index,follow', 'index,follow', 'vi', 17, NULL, '2021-06-25 01:44:26', '2021-06-25 01:44:26'),
(18, '4c4fee77-a44b-4042-ac0a-7095bd408ee5', 'Xuất khẩu đồ nội thất phòng khách và phòng ăn bằng gỗ dự báo nhiều cơ hội tăng trưởng nhanh', 'Vũ Quốc Tuấn', NULL, '<article>\r\n<p>Theo số liệu từ Tổng cục Hải quan, xuất khẩu gỗ và sản phẩm gỗ 5 tháng đầu năm 2021 đạt 6,63 tỷ USD, tăng 62% so với cùng kỳ năm 2020. Đặc biệt mặt hàng đồ nội thất phòng khách và phòng ăn bằng gỗ xuất khẩu rất khả quan và được dự báo có nhiều cơ hội tăng trưởng nhanh trong thời gian tới. Tuy nhiên, những rủi ro liên quan đến phòng vệ thương mại là vấn đề cần được doanh nghiệp chú trọng.</p>\r\n</article>', '<p>Theo số liệu từ Tổng cục Hải quan, trong 5 tháng đầu năm 2021, kim ngạch xuất khẩu gỗ và sản phẩm gỗ đạt 6,63 tỷ USD, tăng 62% so với cùng kỳ năm 2020. Trong đó, kim ngạch xuất khẩu sản phẩm gỗ đạt 5,13 tỷ USD, tăng 80,4% so với cùng kỳ năm 2020.</p>\r\n\r\n<p>Dịch Covid-19 xảy ra trên toàn cầu gây ảnh hưởng mạnh đến hàng loạt chuỗi cung ứng hàng hóa trên thị trường thế giới, trong đó có ngành chế biến và xuất khẩu gỗ Việt Nam. Nhưng bất chấp diễn biến phức tạp của dịch bệnh từ các quốc gia nói chung, trong nước nói riêng, ngành chế biến, xuất khẩu gỗ và đồ gỗ Việt Nam, đặc biệt là mặt hàng đồ nội thất phòng khách và phòng ăn xuất khẩu vẫn rất khả quan.</p>', NULL, 'http://localhost:8000/uploads/files/4243_mot_khau_trong_san_xuat_tu_bep.jpg', NULL, NULL, 'xuat-khau-do-noi-that-phong-khach-va-phong-an-bang-go-du-bao-nhieu-co-hoi-tang-truong-nhanh', 'Xuất khẩu đồ nội thất phòng khách và phòng ăn bằng gỗ dự báo nhiều cơ hội tăng trưởng nhanh', NULL, NULL, 'index,follow', 'index,follow', 'vi', 18, NULL, '2021-06-25 01:45:21', '2021-06-25 01:45:21'),
(19, '90b052f4-86c2-4352-9f19-8ccac434cb69', 'Điều chỉnh thời gian thực hiện Tháng khuyến mại tập trung quốc gia 2021', 'Vũ Quốc Tuấn', NULL, '<article>\r\n<p>Bộ Công Thương đã ban hành quyết định điều chỉnh thời gian thực hiện Tháng khuyến mại tập trung quốc gia 2021- Vietnam Grand Sale 2021 nhằm đảm bảo an toàn cho người dân trong bối cảnh dịch Covid-19 đang diễn biến phức tạp.</p>\r\n</article>', '<p>Chương trình khuyến mại được tổ chức đồng thời trên phạm vi toàn quốc, kết hợp các hoạt động thương mại truyền thống và thương mại điện tử để tạo sức lan toả và thu hút sự tham gia của các doanh nghiệp sản xuất, kinh doanh trên mọi lĩnh vực. Thông qua Tháng khuyến mại tập trung quốc gia 2021 - Vietnam Grand Sale 2021, các doanh nghiệp sẽ chủ động thực hiện nhiều hoạt động khuyến mại với nội dung đa dạng hấp dẫn để người tiêu dùng mua sắm được những sản phẩm hàng hoá, dịch vụ đảm bảo chất lượng, giá cả phù hợp. Đáng lưu ý, hạn mức tối đa giá trị hàng hoá, dịch vụ dùng để khuyến mại và giảm giá tối đa đối với hàng hoá, dịch vụ được khuyến mại là 100%.</p>', NULL, 'http://localhost:8000/uploads/files/3033_thang_khuyen_mai_tap_trung_quoc_gia_1.jpg', NULL, NULL, 'dieu-chinh-thoi-gian-thuc-hien-thang-khuyen-mai-tap-trung-quoc-gia-2021', 'Điều chỉnh thời gian thực hiện Tháng khuyến mại tập trung quốc gia 2021', NULL, NULL, 'index,follow', 'index,follow', 'vi', 19, NULL, '2021-06-25 01:46:04', '2021-06-25 01:46:04'),
(20, '261da021-cbfb-4560-8338-915dcd11d410', 'Canada tăng nhập khẩu gỗ và sản phẩm gỗ từ thị trường Việt Nam', 'Vũ Quốc Tuấn', NULL, '<article>\r\n<p>Trong 5 tháng đầu năm 2021, kim ngạch xuất khẩu gỗ và sản phẩm gỗ sang thị trường Canada đạt 104,3 triệu USD, tăng 69,3% so với cùng kỳ năm 2020. Sau thời gian tạm lắng do ảnh hưởng của dịch Covid-19, thị trường nhà đất ở Canada bắt đầu nóng lên kể từ tháng 5/2020 đến nay và chưa có dấu hiệu hạ nhiệt. Đây là lý do chính khiến nhu cầu nhập khẩu đồ nội thất bằng gỗ của Canada tăng mạnh trong thời gian qua.</p>\r\n</article>', '<p>Trong đó, đồ nội thất phòng khách và phòng ăn, ghế khung gỗ, đồ nội thất phòng ngủ là 3 mặt hàng xuất khẩu chiếm tỷ trọng cao nhất tới thị trường Canada. Trong đó, kim ngạch xuất khẩu đồ nội thất nhà bếp, ghế khung gỗ, đồ nội thất phòng khách và phòng ăn đạt tốc độ tăng trưởng rất cao sang thị trường Canada.</p>\r\n\r\n<p>Đáng chú ý, gỗ và ván sàn xuất khẩu tới thị trường Canada đạt 5,1 triệu USD trong 4 tháng đầu năm 2021, tăng 203,8% so với cùng kỳ năm 2020. Tiếp theo là mặt hàng gỗ mỹ nghệ đạt 268 nghìn USD, tăng 472,7% so với cùng kỳ năm 2020.</p>\r\n\r\n<p>Tại Canada, sau thời gian tạm lắng do ảnh hưởng của dịch Covid-19, thị trường nhà đất ở Canada bắt đầu nóng lên kể từ tháng 5/2020 đến nay và chưa có dấu hiệu hạ nhiệt. Đây là lý do chính khiến nhu cầu nhập khẩu đồ nội thất bằng gỗ của Canada tăng mạnh trong thời gian qua.</p>', NULL, 'http://localhost:8000/uploads/files/2851_xuat-khau-go.jpg', NULL, NULL, 'canada-tang-nhap-khau-go-va-san-pham-go-tu-thi-truong-viet-nam', 'Canada tăng nhập khẩu gỗ và sản phẩm gỗ từ thị trường Việt Nam', NULL, NULL, 'index,follow', 'index,follow', 'vi', 20, NULL, '2021-06-25 01:46:56', '2021-06-25 01:46:56'),
(21, 'ee3607a8-cbac-4c46-a6d7-414107883d67', 'Thương hiệu Quốc gia Việt Nam: Xác lập vị thế mới', 'Vũ Quốc Tuấn', NULL, '<article>\r\n<p>Giá trị Thương hiệu Quốc gia (THQG) Việt Nam tăng trưởng ngày một nhanh và nằm trong top các thương hiệu mạnh trên thế giới. Vị thế này còn có triển vọng tăng trưởng mạnh hơn nữa khi các hiệp định thương mại tự do đã có hiệu lực đang được Việt Nam nỗ lực tận dụng triệt để.</p>\r\n</article>', '<p>THQG Việt Nam - chương trình duy nhất của Chính phủ giao Bộ Công Thương là cơ quan thường trực, chịu trách nhiệm phối hợp với các bộ, ngành triển khai thực hiện - nhằm quảng bá hình ảnh quốc gia, THQG thông qua việc hỗ trợ các doanh nghiệp (DN) phát triển thương hiệu sản phẩm, hàng hóa và dịch vụ của Việt Nam; nâng cao vị thế và giá trị gia tăng trong từng ngành hàng, lĩnh vực của nền kinh tế.</p>\r\n\r\n<p>Chương trình THQG Việt Nam dựa trên các tiêu chí: Chất lượng - đổi mới, sáng tạo - năng lực tiên phong, hướng đến mục tiêu xây dựng hình ảnh Việt Nam là quốc gia có uy tín về hàng hóa, dịch vụ với chất lượng cao, tăng niềm tự hào và sức hấp dẫn của đất nước, con người Việt Nam; góp phần thúc đẩy phát triển ngoại thương và nâng cao năng lực cạnh tranh quốc gia.</p>', NULL, 'http://localhost:8000/uploads/files/2554_thuong-hieu.jpg', NULL, NULL, 'thuong-hieu-quoc-gia-viet-nam-xac-lap-vi-the-moi', 'Thương hiệu Quốc gia Việt Nam: Xác lập vị thế mới', NULL, NULL, 'index,follow', 'index,follow', 'vi', 21, NULL, '2021-06-25 01:47:39', '2021-06-25 01:47:39'),
(22, '774280ba-7659-4a35-b4e5-70a2ce0d45fb', 'Yêu thật lòng nhưng tôi đau đớn nhận ra mình chỉ là người \'thế thân\'', 'Vũ Quốc Tuấn', NULL, '<p>Tôi yêu thật lòng nhưng hóa ra chỉ là người thứ ba xen vào giữa mối quan hệ của họ, để họ đo đếm tình cảm dành cho nhau.</p>', '<p>Tôi gặp người yêu trong một buổi team building. Lúc đó, tôi là sinh viên năm thứ hai và anh ấy đã tốt nghiệp đại học được một năm.&nbsp;</p>\r\n\r\n<p>Tôi xin làm part time tại một cửa hàng của công ty anh, vừa để tích lũy kinh nghiệm vừa để trang trải thêm cuộc sống, đỡ gánh nặng cho bố mẹ ở quê. Khi công ty tổ chức cho nhân viên đi du lịch hè, tôi cũng được tham gia.</p>\r\n\r\n<p>Trong một trò chơi team building ở điểm du lịch, tôi tình cờ đứng cạnh anh. Trò chơi yêu cầu mọi người phải cầm tay nhau, anh đã nắm tay tôi. Buổi hôm đó, chúng tôi chơi rất vui và cũng nhanh chóng quen nhau hơn.</p>\r\n\r\n<p>Trong suốt chuyến du lịch thỉnh thoảng gặp gỡ, anh chủ động chào hỏi và bắt chuyện với tôi rất cởi mở như những đồng nghiệp thật sự. Điều đó khiến tôi chú ý và có ấn tượng tốt về anh. Khi anh xin số điện thoại và nick chat tôi cũng không đắn đo mà cho anh.</p>', NULL, 'http://localhost:8000/uploads/files/yeu-that-long-mot-nguoi-nhung-cuoi-cung-toi-dau-don-nhan-ra-minh-chi-la-ke-thu-ba-1.jpg', NULL, NULL, 'yeu-that-long-nhung-toi-dau-don-nhan-ra-minh-chi-la-nguoi-the-than', 'Yêu thật lòng nhưng tôi đau đớn nhận ra mình chỉ là người \'thế thân\'', NULL, NULL, 'index,follow', 'index,follow', 'vi', 22, NULL, '2021-06-25 01:49:01', '2021-06-25 01:49:01'),
(23, '405ffef1-0772-427b-a40c-cee20d8ad9aa', 'Mẹ tôi ốm, chồng không cho tôi về thăm', 'Vũ Quốc Tuấn', NULL, '<p>Tôi còn đang phân vân thì chị tôi lại gọi điện bảo mẹ đã khỏe và đã về nhà, tôi không phải lo lắng nên tôi không về nữa. Nhưng nếu lại có lần khác như thế tôi phải làm sao để mọi thứ được trọn vẹn?</p>', '<p>Ngày tôi theo anh về nhà, bố mẹ tôi khóc rất nhiều vì thương tôi lấy chồng xa. Ai cũng thắc mắc gần bao người theo đuổi mà không gật lại đi lấy một anh chồng xa như thế.</p>\r\n\r\n<p>Tôi tốt nghiệp đại học, ra trường là có việc làm ngay. Nhan sắc không quá xinh nhưng cũng nhiều người thầm thương trộm nhớ. Tôi nghĩ do cái duyên nên tất cả những anh ở gần tôi tôi đều không thích, có người&nbsp;<a href=\"https://vietnamnet.vn/vn/doi-song/gia-dinh/\">gia đình</a>&nbsp;rất điều kiện, có người còn chức tước, công danh.</p>\r\n\r\n<p>Ấy vậy mà tôi không thích ai, tình cờ gặp anh trong một lần công tác tôi lại yêu anh. Nhà anh cách nhà tôi hơn 100km, chúng tôi có thời gian yêu xa gần 2 năm mới tiến tới hôn nhân.</p>', NULL, 'http://localhost:8000/uploads/files/hoa-2.jpg', NULL, NULL, 'me-toi-om-chong-khong-cho-toi-ve-tham', 'Mẹ tôi ốm, chồng không cho tôi về thăm', NULL, NULL, 'index,follow', 'index,follow', 'vi', 23, NULL, '2021-06-25 01:49:59', '2021-06-25 01:49:59'),
(24, 'c3f2ec56-7676-464f-83e5-edceca4ae219', 'Tủ lạnh cộng đồng\' giữa Sài thành khiến bao người xúc động', 'Vũ Quốc Tuấn', NULL, '<p>Mỗi ngày, người dân khó khăn ở TP.HCM có thể đến lấy rau, củ, trứng, thịt… miễn phí trong chiếc ‘tủ lạnh cộng đồng’ đặt trên vỉa hè.</p>', '<p>Chiều 23/6, anh Nguyễn Tuấn Khởi, giám đốc&nbsp;một công ty, cẩn thận đẩy chiếc tủ lạnh có dán dòng chữ “Tủ lạnh cộng đồng, thực phẩm miễn phí” ra vỉa hè tại số 100 Ung Văn Khiêm (phường 25, quận Bình Thạnh, TP.HCM).</p>\r\n\r\n<p>Đây là chiếc tủ lạnh chứa thực phẩm miễn phí, cho phép người dân có nhu cầu đến nhận mỗi ngày. Anh Khởi là người sáng lập, tổ chức chiếc tủ lạnh mang nhiều ý nghĩa này.</p>\r\n\r\n<p>“Tủ lạnh cộng đồng đã có mặt ở Mỹ và một số các nước khác khi đại dịch Covid-19 bùng phát. Mô hình này chủ yếu được sử dụng vào mục đích trung chuyển thực phẩm giữa người dư và người thiếu thực phẩm. Người dư sẽ đến bỏ thực phẩm vào các tủ lạnh này để người thiếu đến lấy”, anh Khởi chia sẻ.</p>', NULL, 'http://localhost:8000/uploads/files/tu-lanh-cong-dong-giup-nguoi-dan-am-long-mua-dich.jpg', NULL, NULL, 'tu-lanh-cong-dong-giua-sai-thanh-khien-bao-nguoi-xuc-dong', 'Tủ lạnh cộng đồng\' giữa Sài thành khiến bao người xúc động', NULL, NULL, 'index,follow', 'index,follow', 'vi', 24, NULL, '2021-06-25 01:51:07', '2021-06-25 01:51:07'),
(25, '1e1f4f30-e5bb-4580-843e-bec31af7f7ba', 'Phó Chủ tịch Bắc Ninh nói về bài học chống dịch \'không có đường lui\'', 'Vũ Quốc Tuấn', NULL, '<p>Trong bối cảnh dịch Covid-19 diễn biến phức tạp, Bắc Ninh đã chọn phương án sàng lọc đưa “công nhân sạch” vào nhà máy để duy trì hoạt động sản xuất tại khu công nghiệp.</p>', '<p>Phó Chủ tịch Bắc Ninh Vương Quốc Tuấn chia sẻ, ngay từ ngày đầu phát hiện các ca mắc&nbsp;Covid-19,&nbsp;với quyết tâm thực hiện bằng được “mục tiêu kép”, tỉnh không chủ trương \'đóng cửa\' cực đoan để phòng dịch.</p>\r\n\r\n<p>Bởi lẽ, nếu chọn phương án dừng tất cả các hoạt động để cách ly, phong tỏa và dập dịch, như vậy sẽ dễ dàng cho lực lượng chống dịch rất&nbsp;nhiều,&nbsp;nhưng tổn thất về kinh tế và ảnh hưởng đến xã hội thì rất lớn.&nbsp;</p>', NULL, 'http://localhost:8000/uploads/files/pho-chu-tich-bac-ninh-noi-ve-thoi-khac-can-nao-chong-dich-khong-co-duong-lui-1.jpg', NULL, NULL, 'pho-chu-tich-bac-ninh-noi-ve-bai-hoc-chong-dich-khong-co-duong-lui', 'Phó Chủ tịch Bắc Ninh nói về bài học chống dịch \'không có đường lui\'', NULL, NULL, 'index,follow', 'index,follow', 'vi', 25, NULL, '2021-06-25 01:52:02', '2021-06-25 01:52:02'),
(26, '20c06c42-eb9e-4672-8ed2-8d102dd77678', 'Thanh niên thử trồng mướp trong chai nhựa, thành quả khiến dân mạng bất ngờ', 'Vũ Quốc Tuấn', NULL, '<h2>Sau 20 ngày chờ đợi, thành quả độc lạ của chàng trai khiến cư dân mạng vô cùng thích thú.</h2>', '<p>TikTok là nền tảng luôn đem lại người xem những điều bất ngờ khiến nhiều người phải thốt lên rằng \"trên đời cái gì cũng có thể xảy ra\".</p>\r\n\r\n<p>Mới đây, một thanh niên đã đăng tải quá trình thử trồng mướp trong chai nhựa khiến dân mạng không thể rời mắt. Hiện tất cả những đoạn clip về trái mướp đặc biệt của anh chàng đều thu về lượng tương tác cực \"khủng\".</p>\r\n\r\n<p>Ngay từ khi trái mướp mới chỉ nhỏ xíu, chàng trai đã đặt nó vào trong một chai nhựa và hồi hộp chờ đợi trong 20 ngày để thu hoạch thành quả.</p>\r\n\r\n<p>Có thể thấy, trái mướp sau khi lớn đã lấp kín phần bên trong chai. Để người xem không phải chờ đợi, anh thanh niên đã thực hiện cắt bỏ phần vỏ chai để mọi người cùng chiêm ngưỡng trái mướp bên ngoài sẽ có hình dáng như thế nào.</p>', NULL, 'http://localhost:8000/uploads/files/1thanh-nien-thu-trong-muop-trong-chai-nhua-thanh-qua-khien-dan-mang-bat-ngo.jpg', NULL, NULL, 'thanh-nien-thu-trong-muop-trong-chai-nhua-thanh-qua-khien-dan-mang-bat-ngo', 'Thanh niên thử trồng mướp trong chai nhựa, thành quả khiến dân mạng bất ngờ', NULL, NULL, 'index,follow', 'index,follow', 'vi', 26, NULL, '2021-06-25 01:53:29', '2021-06-25 01:53:29'),
(27, 'f6dba90d-5cae-4e51-bf7d-74913b56d4ea', 'Công nghệ rô bốt sơn ôtô Pixelpaint, tương lai của cá nhân hóa', 'Vũ Quốc Tuấn', NULL, '<h2>Với công nghệ rô bốt sơn ôtô Pixelpaint, mọi thiết kế sơn cá nhân hóa độc đáo cho mọi nhu cầu của khách hàng đều có thể thành hiện thực một cách chuẩn xác, hiệu quả hơn hiện tại.<button aria-label=\"Next Up Close\"></button></h2>', '<p>Song hành với sự phát triển của ôtô hiện đại, các quy trình sản xuất ví như&nbsp;<strong>sơn xe ôtô</strong>&nbsp;cũng đang có những bước tiến vượt bậc. Bên cạnh những kỹ thuật thủ công, rô bốt cũng đang sử dụng ngày một nhiều, và chúng có thể khiến cho nước sơn không chỉ bền vững và hiệu quả hơn, mà còn ngầu hơn, bởi giờ đây sự sáng tạo dường như là vô hạn.</p>', NULL, 'http://localhost:8000/uploads/files/1cong-nghe-ro-bot-son-oto-pixelpaint-tuong-lai-cua-ca-nhan-hoa.png', NULL, NULL, 'cong-nghe-ro-bot-son-oto-pixelpaint-tuong-lai-cua-ca-nhan-hoa', 'Công nghệ rô bốt sơn ôtô Pixelpaint, tương lai của cá nhân hóa', NULL, NULL, 'index,follow', 'index,follow', 'vi', 27, NULL, '2021-06-25 01:54:20', '2021-06-25 01:54:20'),
(28, '20ca7af1-dc68-464f-a7e2-e2889c832671', 'Thư rác trên Lịch iCloud tiếp tục ảnh hưởng đến người dùng, bất chấp nhiều bản sửa lỗi của Apple', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/icloud-calendar-spam-problems-TECHRUM-cover38ec32ef40e2492e.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/icloud-calendar-spam-problems-TECHRUM-cover38ec32ef40e2492e.jpg\" />​</p>\r\n\r\n<p><br />\r\nThư rác trên Lịch iCloud là một hình thức spam nghiêm trọng đối kể từ 2016. Mặc dù Apple đã thực hiện một số thay đổi nhằm khắc phục tình trạng này, nhưng bất chấp những nỗ lực của công ty thì vấn đề trên vẫn tiếp tục ảnh hưởng đến người dùng iCloud trong nhiều năm qua và rất khó để loại bỏ triệt để!</p>', '<p>Có nhiều cách để gửi thư rác qua ứng dụng Lịch, ví dụ như vào năm 2016, hình thức spam này xuất hiện qua lời mời sự kiện hoặc chia sẻ ảnh. Sau đó chuyển thành các lời mời tham gia chương trình mua sắm, khuyến mãi, liên kết kèm theo quảng cáo thường thấy trên những trang web 18+, link rút gọn adf.ly - bitly.link - tiny.cc - shorturl.at hay cutt.ly v.v...<br />\r\n<br />\r\nNgoài ra, qua một chủ đề trên diễn đàn Reddit thì hình thức spam mới xuất hiện dưới dạng cửa sổ nổi tự động trên các trang web mờ ám. Đây là dạng quảng cáo ép buộc người dùng khi truy cập vào một địa chỉ nhất định, nó sẽ hỏi bạn rằng có muốn trêm lịch sự kiện (với nội dung giả mạo nhằm đánh lừa người xem). Vấn đề nghiêm trọng nằm ở chỗ Apple không cho phép chặn hoàn toàn lời mời tham gia lịch sự kiện, ngay cả khi đã nhấn \"từ chối\" thì hệ thống spam thư vẫn tiếp tục gửi đến các lời mời khác trong tương lai do đã nhận biết rằng tài khoản đó đang hoạt động!<br />\r\n&nbsp;</p>\r\n\r\n<p><a href=\"https://twitter.com/i/web/status/1406670511808057350\" rel=\"external\" target=\"_blank\">&nbsp;https://twitter.com/i/web/status/1406670511808057350</a></p>\r\n\r\n<p><iframe allowfullscreen=\"true\" allowtransparency=\"true\" data-tweet-id=\"1406670511808057350\" frameborder=\"0\" id=\"twitter-widget-0\" scrolling=\"no\" src=\"https://platform.twitter.com/embed/Tweet.html?dnt=false&amp;embedId=twitter-widget-0&amp;features=eyJ0ZndfZXhwZXJpbWVudHNfY29va2llX2V4cGlyYXRpb24iOnsiYnVja2V0IjoxMjA5NjAwLCJ2ZXJzaW9uIjpudWxsfSwidGZ3X2hvcml6b25fdHdlZXRfZW1iZWRfOTU1NSI6eyJidWNrZXQiOiJodGUiLCJ2ZXJzaW9uIjpudWxsfSwidGZ3X3R3ZWV0X2VtYmVkX2NsaWNrYWJpbGl0eV8xMjEwMiI6eyJidWNrZXQiOiJjb250cm9sIiwidmVyc2lvbiI6bnVsbH19&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1406670511808057350&amp;lang=vi&amp;origin=https%3A%2F%2Fwww.techrum.vn%2Fthreads%2Fth%25C6%25B0-r%25C3%25A1c-tr%25C3%25AAn-l%25E1%25BB%258Bch-icloud-ti%25E1%25BA%25BFp-t%25E1%25BB%25A5c-%25E1%25BA%25A3nh-h%25C6%25B0%25E1%25BB%259Fng-%25C4%2591%25E1%25BA%25BFn-ng%25C6%25B0%25E1%25BB%259Di-d%25C3%25B9ng-b%25E1%25BA%25A5t-ch%25E1%25BA%25A5p-nhi%25E1%25BB%2581u-b%25E1%25BA%25A3n-s%25E1%25BB%25ADa-l%25E1%25BB%2597i-c%25E1%25BB%25A7a-apple.449292%2F&amp;sessionId=643c4ae94f53a9c0407d10676acc082dc342aeac&amp;theme=light&amp;widgetsVersion=82e1070%3A1619632193066&amp;width=550px\" title=\"Twitter Tweet\"></iframe></p>\r\n\r\n<p><br />\r\nVì vậy, ở thời điểm hiện tại chúng ta chỉ có thể khắc phục vấn đề này theo cách thủ công là ẩn tất cả thông báo từ các nguồn đã theo dõi, sau đó xóa trực tiếp trong mục Tài khoản &amp; Mật khẩu của Cài đặt hệ thống<br />\r\n<br />\r\n<b>Thao tác thực hiện như sau:</b></p>\r\n\r\n<ol>\r\n	<li data-xf-list-type=\"ol\">Mở ứng dụng Lịch</li>\r\n	<li data-xf-list-type=\"ol\">Nhấn vào một sự kiện spam</li>\r\n	<li data-xf-list-type=\"ol\">Tìm nút \"Hủy đăng ký khỏi Lịch này\" ở dưới cùng</li>\r\n</ol>\r\n\r\n<p>Thao tác trên sẽ tự động xóa tất cả các sự kiện spam khác từ lịch cụ thể khỏi iPhone của bạn. Tuy nhiên, sẽ cần phải lặp lại quá trình này nếu đã đăng ký nhiều lịch spam. Quá trình này dễ dàng hơn nhiều so với trước đây, cho thấy rằng Apple đã nhận thức được vấn đề và đang nỗ lực để thực hiện các thay đổi.<br />\r\n<br />\r\nBên cạnh đó, công ty cũng bổ sung thêm một nút \"Báo cáo thư rác\" mới cho Lịch iCloud, giúp người dùng loại bỏ những nội dung không mong muốn khỏi lịch của họ. Tuy nhiên, chủ yếu tập trung vào thư rác được gửi qua Lịch iCloud, thay vì thư rác và các sự kiện khác được thêm vào do cửa sổ bật lên trên trình duyệt web Safari. Trong trường hợp này, bạn tham khảo thêm cách khắc phục qua bài viết sau:&nbsp;<a href=\"https://www.techrum.vn/threads/h%C6%B0%E1%BB%9Bng-d%E1%BA%ABn-x%C3%B3a-th%C3%B4ng-b%C3%A1o-l%E1%BA%A1-t%E1%BB%AB-%E1%BB%A9ng-d%E1%BB%A5ng-l%E1%BB%8Bch-m%E1%BA%B7c-%C4%91%E1%BB%8Bnh-tr%C3%AAn-ios-tipios.292450/\">https://www.techrum.vn/threads/hướn...ng-dụng-lịch-mặc-định-trên-ios-tipios.292450/</a></p>', NULL, 'http://localhost:8000/uploads/files/icloud-calendar-spam-problems-TECHRUM-cover38ec32ef40e2492e.jpg', NULL, NULL, 'thu-rac-tren-lich-icloud-tiep-tuc-anh-huong-den-nguoi-dung-bat-chap-nhieu-ban-sua-loi-cua-apple', 'Thư rác trên Lịch iCloud tiếp tục ảnh hưởng đến người dùng, bất chấp nhiều bản sửa lỗi của Apple', NULL, NULL, 'index,follow', 'index,follow', 'vi', 28, NULL, '2021-06-25 02:01:35', '2021-06-25 02:01:35'),
(29, '7ea4e5cf-d410-41b7-aaa0-75d6ff67cebb', 'Tecno POVA 2 chính thức ra mắt ở Việt Nam với màn hình đục lỗ, chip Helio G85, cụm bốn camera AI, giá khởi điểm 3.990.000 VNĐ', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/pova-2-259afde5a6b3cffe2.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/pova-2-259afde5a6b3cffe2.jpg\" /><br />\r\n​</p>\r\n\r\n<p>Sau một thời gian dài im lặng khiến nhiều người tưởng như TECNO đã biến mất khỏi thị trường Việt Nam, mới đây hãng vừa công bố sản phẩm mới là TECNO POVA 2 với nhiều điểm đáng chú ý.</p>', '<p>&nbsp;</p>\r\n\r\n<p>Theo đó, với TECNO POVA 2 thì máy sỡ hữu màn hình đục lỗ 6.9 inch, độ phân giải FHD, 1080 x 2460 pixels, hỗ trợ tần số quét cảm ứng 180Hz cho trải nghiệm vuốt và chạm luôn nhanh chóng và mượt mà.<br />\r\n<br />\r\nMáy chạy chip Helio G85 với CPU gồm 2 lõi Cortex-A75 với tốc độ 2.0 GHz và 6 lõi Cortex-A5 với tốc độ 1.8 GHz cùng GPU ARM Mali-G52 với tốc độ 1 GHz, giúp cho trải nghiệm được tối ưu.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/pova-2-scr-23ddbc9e5cbf867d5.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/pova-2-scr-23ddbc9e5cbf867d5.jpg\" /><br />\r\n​</p>\r\n\r\n<p>TECNO POVA 2 trang bị cụm bốn camera gồm ống kính chính 48MP f/1.9, PDAF, ống kính macro 2MP và 2 ống kính chiều sâu 2MP, hỗ trợ quay video 1440p/30fps cùng nhiều tính năng chụp hình thông minh. Chuyển sang mặt trước, máy trang bị camera selfie 8MP f/2.0 cho mọi khoảnh khắc selfie luôn được lung linh và ảo diệu.<br />\r\n<br />\r\nMáy sỡ hữu dung lượng pin 7000 mAh, hỗ trợ sạc nhanh 18W, cổng USB Type-C 2.0, cảm biến vân tay tích hợp trong nút nguồn, jack 3.5mm, chạy HiOS 7.6 dựa trên nền tảng Android 11 cùng nhiều chức năng khác.<br />\r\n<br />\r\nTECNO POVA 2 ra mắt với 2 màu gồm Polar Silver và Dazzle Black (không có màu Power Blue), với 2 mức dung lượng cùng mức giá bán lẻ đề nghị như sau:</p>\r\n\r\n<ul>\r\n	<li data-xf-list-type=\"ul\"><b>RAM 4GB + ROM 64GB</b>&nbsp;với mức giá&nbsp;<b>3 990 000 VNĐ</b></li>\r\n	<li data-xf-list-type=\"ul\"><b>RAM 6GB + ROM 128GB</b>&nbsp;với mức giá&nbsp;<b>4 990 000 VNĐ</b></li>\r\n</ul>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/pova-see21c5f1c4da7a84ef.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/pova-see21c5f1c4da7a84ef.jpg\" /><br />\r\n​</p>\r\n\r\n<p>Tuy nhiên, khi người dùng đặt hàng từ&nbsp;<b>19/6 - 22/6/2021</b>&nbsp;sẽ giảm ngay lên đến 700 ngàn VNĐ, tức chỉ còn&nbsp;<b>3 690 000 VNĐ</b>&nbsp;cho phiên bản&nbsp;<b>RAM 4GB + ROM 64GB</b>&nbsp;và&nbsp;<b>4 290 000 VNĐ</b>&nbsp;cho phiên bản&nbsp;<b>RAM 6GB + ROM 128GB&nbsp;</b>và được tặng kèm tai nghe trị giá 399 000 VNĐ.<br />\r\n<br />\r\nNgoài ra, nếu người dùng không muốn tặng kèm tai nghe thì vào ngày mai (<b>23/6</b>), TECNO cũng mở chương trình giảm giá sâu hơn, lên đến 1 triệu VNĐ khi mua phiên bản&nbsp;<b>RAM 4GB + ROM 64GB</b>&nbsp;chỉ còn&nbsp;<b>3 490 000 VNĐ</b>&nbsp;và phiên bản&nbsp;<b>RAM 6GB + ROM 128GB</b>&nbsp;chỉ còn&nbsp;<b>3 990 000 VNĐ</b>.<br />\r\n<br />\r\nSản phẩm được mở bán chính thức trên trang thương mại điện tử Shopee và chi tiết chương trình, bạn có thể xem tại đây:</p>\r\n\r\n<ul>\r\n	<li data-xf-list-type=\"ul\">Mua tại đây:&nbsp;<a href=\"https://shopee.vn/tecno_official_store\" rel=\"nofollow noopener\" target=\"_blank\">TECNO Official Store | Shopee</a></li>\r\n	<li data-xf-list-type=\"ul\">Cửa hàng uỷ quyền:&nbsp;<a href=\"https://shopee.vn/tecno_authorized_store\" rel=\"nofollow noopener\" target=\"_blank\">TECNO Authorized Store | Shopee</a></li>\r\n	<li data-xf-list-type=\"ul\">Chương trình khuyến mãi:&nbsp;<a href=\"https://shopee.vn/m/tecno-day\" rel=\"nofollow noopener\" target=\"_blank\">Ưu đãi mua TECNO POVA 2 | Shopee</a></li>\r\n</ul>\r\n\r\n<p><iframe allowfullscreen=\"true\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/1ENfCLAr4JM?wmode=opaque&amp;start=0\" width=\"560\"></iframe></p>', NULL, 'http://localhost:8000/uploads/files/pova-2-259afde5a6b3cffe2.jpg', NULL, NULL, 'tecno-pova-2-chinh-thuc-ra-mat-o-viet-nam-voi-man-hinh-duc-lo-chip-helio-g85-cum-bon-camera-ai-gia-khoi-diem-3990000-vnd', 'Tecno POVA 2 chính thức ra mắt ở Việt Nam với màn hình đục lỗ, chip Helio G85, cụm bốn camera AI, giá khởi điểm 3.990.000 VNĐ', NULL, NULL, 'index,follow', 'index,follow', 'vi', 29, NULL, '2021-06-25 02:03:10', '2021-06-25 02:03:10'),
(30, 'ca35f487-0386-43d2-8039-3675458fae94', '[Hài hước] Tổng hợp những lần Internet Explorer bị Giang Cư Mận cho lên bờ xuống ruộng', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/2c11315bcaa3264b1c4d1e8b6caed0b1dfc82fc507.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/2c11315bcaa3264b1c4d1e8b6caed0b1dfc82fc507.jpg\" />​</p>\r\n\r\n<p><br />\r\n\"Chậm\", \"đơ\", thậm chí là... \"ngu\" là những từ thường được dùng để mô tả trình duyệt Internet Explorer (còn gọi là IE)- một sản phẩm của ông lớn Microsoft. Có thể nói trong suốt lịch sử internet của nhân loại thì đây là trình duyệt gây ức chế nhất cho người dùng, và cư dân mạng không ít lần đem IE ra làm trò cười trong những chiếc meme của mình.<br />\r\n<br />\r\nXem thêm:&nbsp;<a href=\"https://www.techrum.vn/threads/microsoft-th%C3%B4ng-b%C3%A1o-s%E1%BA%BD-khai-t%E1%BB%AD-ho%C3%A0n-to%C3%A0n-internet-explorer-v%C3%A0o-th%C3%A1ng-6-n%C4%83m-2022.436201/\">Microsoft thông báo sẽ khai tử hoàn toàn Internet Explorer vào tháng 6 năm 2022</a><br />\r\n<br />\r\nĐể giữ tính hài hước, TECHRUM sẽ để nguyên văn tiếng Anh trong meme và dịch sang tiếng Việt bên dưới ảnh.</p>\r\n\r\n<p><br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/995707_659653617383013_1200757877_n-1.jpg.cf_-1-300x405ce876eea97ebc095.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/995707_659653617383013_1200757877_n-1.jpg.cf_-1-300x405ce876eea97ebc095.jpg\" /><br />\r\nChrome: Chúng ta là ai?!<br />\r\nFireFox &amp; Safari: Trình duyệt!<br />\r\nChrome: Chúng ta muốn gì?!<br />\r\n<i>FireFox &amp; Safari: Internet nhanh hơn!<br />\r\nChrome: Khi nào chúng ta ra tay?!<br />\r\nIE: Trình duyệt!</i></i><br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/a6b-1.jpg.cf_-1776f49e66bda3747.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/a6b-1.jpg.cf_-1776f49e66bda3747.jpg\" /><br />\r\nInternet Explorer đã gặp vấn đề và đáng bị xử tử</i><br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/ie-rage-comic.jpeg.cf_-18d9673a205e3c4a2.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/ie-rage-comic.jpeg.cf_-18d9673a205e3c4a2.jpg\" /><br />\r\nNgười dùng: Tau lại lỡ tay mở mài lên. Giờ mài muốn gì?<br />\r\nIE: Chú cho con làm trình duyệt mặc định đi chúúú...<br />\r\nNgười dùng: Không! *xài Chrome*</i><br />\r\n<br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/internet-explorer_o_269567-190b135e53690a39d.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/internet-explorer_o_269567-190b135e53690a39d.jpg\" /><br />\r\nOpera: Tau nhanh. FireFox: Tau nhanh hơn: Chrome: Tau nhanh nhất<br />\r\n<i>Opera: Tau mở một lần 30 trang. FireFox: Tau mở tới 40 trang lận. Chrome: Tau mở tận 50 trang nè<br />\r\nOpera: Thằng kia nó bị cái gì mà im re vậy. IE: Tau khởi động xong rồi nè</i></i><br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/internet-explorer-meme-211-1.jpg.cf_-184a9d2565add99c0.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/internet-explorer-meme-211-1.jpg.cf_-184a9d2565add99c0.jpg\" /><br />\r\nTest web trên trình duyệt và kết đắng với IE</i><br />\r\n<br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/internet-explorer-troll-300x306f2c57324063ea81b.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/internet-explorer-troll-300x306f2c57324063ea81b.jpg\" /><br />\r\nLỡi tay mở IE lên, giờ phải chờ 1 tiếng mới tắt được</i><br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/MEMES-2014-Internet-Explorer.jpg.cf_ef15c410ee4bcd29.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/MEMES-2014-Internet-Explorer.jpg.cf_ef15c410ee4bcd29.jpg\" /><br />\r\nKhởi động tốn 10 phút, báo lỗi 404 (không tìm thấy trang)</i><br />\r\n<br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/Memes-Internet-Explorer.png.cf_4ad3f7ca2d1aab1d.png\" src=\"https://photo.techrum.vn/images/2021/06/22/Memes-Internet-Explorer.png.cf_4ad3f7ca2d1aab1d.png\" /></i><br />\r\nCa này... thua...<br />\r\n<br />\r\n<br />\r\n<i><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/Divertidos-e-ingeniosos-fondos-de-escritorio-se-burlan-de-Internet-Explorer-20-5aa78e9129b4e__700fac86d33bd6a9c7f.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/Divertidos-e-ingeniosos-fondos-de-escritorio-se-burlan-de-Internet-Explorer-20-5aa78e9129b4e__700fac86d33bd6a9c7f.jpg\" /><br />\r\nCoi chừng kao</i><br />\r\n​</p>', NULL, '<p>IE hiện đang đi đến \"những năm tháng cuối đời\" khi bị Microsoft tuyên bố \"khai tử\". Ban đầu, hãng dự định sẽ ngưng hỗ trợ trình duyệt này vào cuối năm nay, nhưng sau đó dời lại đến tháng 6/2022. Hiện người dùng có thể sử dụng trình duyệt Microsoft Edge đi kèm hệ điều hành Windows.<br />\r\n&nbsp;</p>', 'http://localhost:8000/uploads/files/2c11315bcaa3264b1c4d1e8b6caed0b1dfc82fc507.jpg', NULL, NULL, 'hai-huoc-tong-hop-nhung-lan-internet-explorer-bi-giang-cu-man-cho-len-bo-xuong-ruong', '[Hài hước] Tổng hợp những lần Internet Explorer bị Giang Cư Mận cho lên bờ xuống ruộng', NULL, NULL, 'index,follow', 'index,follow', 'vi', 30, NULL, '2021-06-25 02:04:05', '2021-06-25 02:04:05'),
(31, 'ed7be6d2-8ec8-442a-9492-8aae338b41de', 'Mua sắm trên Shopee vốn đã rẻ, nhưng hội cao thủ vẫn có cách để làm chúng rẻ hơn', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/image121dc0141d045311d.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/image121dc0141d045311d.jpg\" />​</p>\r\n\r\n<p><br />\r\nNhờ những ưu đãi độc quyền, ShopeePay đã trở thành bí quyết giúp không ít người dùng “hóa phép” đơn hàng Shopee trở nên rẻ nhất có thể. Thực hư về quyền năng của ví điện tử này sẽ được hé lộ qua câu chuyện của ba “cao thủ” dưới đây.</p>', '<p>TẬN DỤNG ĐẶC QUYỀN NGƯỜI DÙNG MỚI<br />\r\n<br />\r\nLà một bà mẹ trẻ, Tú Uyên cho biết việc chăm con bận rộn khiến mua sắm trực tuyến trở thành một phương pháp tiết kiệm thời gian. Vẫn giữ thói quen thanh toán đơn hàng bằng tiền mặt cho đến một năm về trước, nhận thức về ưu điểm của việc thanh toán trực tuyến để hạn chế tiếp xúc, bảo vệ sức khỏe cho con nhỏ, Uyên bắt đầu tìm hiểu về ví điện tử.<br />\r\n<br />\r\nCô chọn hỏi thăm một số đồng nghiệp trẻ vì thế hệ này bắt nhịp xu hướng công nghệ rất nhanh, có kiến thức nhất định về ưu và nhược điểm của các sản phẩm. Và&nbsp;<a href=\"https://shopee.vn/m/shopeepay\" rel=\"nofollow noopener\" target=\"_blank\">ShopeePay</a>&nbsp;(tên gọi cũ là AirPay) là “chiếc ví” được Uyên chọn mặt gửi vàng. Trùng hợp, đây cũng là đối tác của sàn thương mại điện tử Shopee - nơi cô gắn bó mua sắm trực tuyến đã hơn 3 năm.</p>\r\n\r\n<p>​</p>\r\n\r\n<p>Về ấn tượng ban đầu với ví ShopeePay, Uyên chia sẻ: “Mình thấy ShopeePay khá hào phóng với người dùng mới khi tặng gói ưu đãi chào mừng có giá trị hấp dẫn, đi cùng phạm vi áp dụng rộng rãi từ mua sắm trên Shopee cho đến nạp điện thoại, thanh toán hóa đơn tiêu dùng thiết yếu. Nhờ món quà này mà những trải nghiệm đầu tiên của mình với ShopeePay đọng lại nhiều niềm vui nhờ tiết kiệm được một khoản khá”.<br />\r\n<br />\r\nTÍCH CỰC GOM MÃ GIẢM GIÁ<br />\r\n<br />\r\nKhông thường xuyên ra ngoài nhiều do làm công việc tự do (freelancer), việc mua sắm online đã trở thành một phần trong cuộc sống của Thanh Tú. Anh cho biết những đợt cần chạy dự án gấp thì hầu như anh ở nhà 24/7, cần sắm gì cũng lên Shopee đặt hàng. Cũng vì thế mà Tú rất chăm chỉ thu thập mã giảm giá để dành dùng dần, tiết kiệm tối đa chi phí.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/image3ec0c30223555a0db.jpg\" src=\"https://photo.techrum.vn/images/2021/06/22/image3ec0c30223555a0db.jpg\" /><br />\r\n<i>Truy cập mục Ví ShopeePay trên ứng dụng Shopee để tìm và lưu những ưu đãi độc quyền</i>​</p>\r\n\r\n<p><br />\r\nBật mí về cách săn ưu đãi của mình, Thanh Tú chia sẻ: “Lúc rảnh tôi thường hay vào mục&nbsp;<a href=\"https://bit.ly/3xq8Lri\" rel=\"nofollow noopener\" target=\"_blank\">Ví ShopeePay</a>&nbsp;trên ứng dụng Shopee để tìm và lưu các mã giảm giá độc quyền. Trong đó, nhóm ưu đãi khi mua hàng Shopee được tôi chú ý nhất. Các mã giảm này khá đa dạng, tuỳ theo từng chương trình sẽ có trị giá và điều khoản sử dụng khác nhau, áp dụng cho nhiều ngành hàng khác nhau”. Sau khi lưu các mã về “Kho Voucher”, đến bước thanh toán, tất cả ưu đãi phù hợp đều sẽ hiện ra, Thanh Tú có thể chọn mã với giá giảm sâu nhất để áp dụng ngay vào đơn mua.<br />\r\n<br />\r\nCHĂM “NẰM VÙNG” GROUP KÍN<br />\r\n<br />\r\nThuộc tuýp người trẻ sành công nghệ và mua sắm thông minh nên những mẹo chốt đơn giá rẻ cô bạn Mỹ Duyên đều nằm lòng kha khá. Ngoài việc tận dụng các ưu đãi độc quyền, Duyên bật mí: “Có hẳn một nơi chỉ cần bạn chăm “nằm vùng” thì không thiếu cơ hội để rinh về những voucher giảm giá hấp dẫn”.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/image286e3d1dc3f2c1d13.png\" src=\"https://photo.techrum.vn/images/2021/06/22/image286e3d1dc3f2c1d13.png\" /><br />\r\n<i>Cuộc thi ShopeePay Check thu hút người chơi nhờ thể lệ đơn giản, quà tặng hấp dẫn</i>​</p>\r\n\r\n<p><br />\r\nVà vùng đất “trong mơ” ấy chính là nhóm Facebook “Ghiền ShopeePay”. Đây là cộng đồng quy tụ hơn 111.000 người dùng “chiếc ví màu cam”, nơi họ chia sẻ thông tin về các mã giảm giá, kinh nghiệm mua sắm… Đặc biệt, nhóm này còn nổi tiếng về độ “chịu chơi” khi tung mini game đều như vắt tranh, đi kèm những giải thưởng giá trị.<br />\r\n<br />\r\nĐơn cử như tại cuộc thi ShopeePay Check tháng 6, người chơi có tổng số lượng bài dự thi nhiều nhất sẽ được trao tặng voucher mua sắm trên Shopee trị giá lên đến 666.000 đồng. Trở thành một thành viên của nhóm “Ghiền ShopeePay” cũng là một bí quyết để các “cao thủ” vừa được cập nhật thông tin bổ ích, vừa có cơ hội rinh về những voucher giá trị giúp đơn Shopee rẻ càng thêm rẻ.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/22/image4ee6d6582ae103f85.png\" src=\"https://photo.techrum.vn/images/2021/06/22/image4ee6d6582ae103f85.png\" /><br />\r\n<i>Ví ShopeePay mang đến trải nghiệm mua sắm và thanh toán trực tuyến tiết kiệm và nhiều niềm vui hơn</i></p>', '<p>Những chia sẻ thực tế của hội người dùng “cao thủ” Tú Uyên, Thanh Tú và Mỹ Duyên phần nào minh chứng cho vai trò quan trọng của ví ShopeePay trong việc giúp đơn hàng Shopee đạt được mức giảm tối đa. Chỉ mất vài phút để cài đặt “chiếc ví màu cam” này là bạn đã mở ra hàng loạt trải nghiệm thanh toán tiện lợi, nhanh chóng và ngập tràn ưu đãi cho chính mình. Thông tin chi tiết&nbsp;<a href=\"https://bit.ly/3q3Op4P\" rel=\"nofollow noopener\" target=\"_blank\">tại đây</a>.<br />\r\n&nbsp;</p>', 'http://localhost:8000/uploads/files/image121dc0141d045311d.jpg', NULL, NULL, 'mua-sam-tren-shopee-von-da-re-nhung-hoi-cao-thu-van-co-cach-de-lam-chung-re-hon', 'Mua sắm trên Shopee vốn đã rẻ, nhưng hội cao thủ vẫn có cách để làm chúng rẻ hơn', NULL, NULL, 'index,follow', 'index,follow', 'vi', 31, NULL, '2021-06-25 02:05:35', '2021-06-25 02:05:35');
INSERT INTO `gigation_news_translations` (`id`, `uuid`, `title`, `author`, `copyright`, `intro`, `content`, `foot`, `image`, `youtube`, `file`, `slug`, `title_tag`, `meta_keywords`, `meta_description`, `meta_robots`, `meta_google_bot`, `locale`, `news_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(32, '1727692f-9c07-43a4-962e-e14da0bd51ea', 'Bộ Công an: Người dân có thể đăng kí hộ khẩu, cư trú, tạm vắng qua mạng và nhận thông báo qua tin nhắn từ 1/7/2021', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/21/0AE2ECAF-4648-472D-A215-2C3A835E18D3b3ca7d4548c5cc41.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/0AE2ECAF-4648-472D-A215-2C3A835E18D3b3ca7d4548c5cc41.jpg\" />​</p>\r\n\r\n<p><br />\r\nHôm 15/5 vừa qua, Bộ Công an đã ban hành Thông tư 55/2021/TT-BCA hướng dẫn Luật Cư trú 2020 với một số điều chỉnh mới, trong đó có việc yêu cầu đăng kí hộ khẩu, cư trú qua mạng.</p>', '<p>Theo đó, Thông tư này quy định về việc đăng kí thường / tạm trú; thông báo lưu trú, khai báo tạm vắng và xác nhận thông tin về cư trú; đăng kí thường trú, đăng kí tạm trú tại nơi đơn vị đóng quân đối với người học tập, công tác, làm việc trong Công an nhân dân; trách nhiệm quản lí cư trú.<br />\r\n<br />\r\nSo với quy định hiện hành áp dụng từ 7 năm trước thì Thông tư mới có nhiều thay đổi quan trọng, trong đó ở việc tiếp nhận hồ sơ và thông báo về kết quả đăng ký cư trú qua mạng, thay vì trực tiếp.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/21/shka693f641f14089b0.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/shka693f641f14089b0.jpg\" />​</p>\r\n\r\n<p><br />\r\nNếu như ở Thông tư số 35/2014<b>,</b>&nbsp;việc nộp hồ sơ đăng kí thường trú, đối với thành phố trực thuộc Trung ương thì nộp hồ sơ tại Công an huyện, quận, thị xã, với tỉnh thì nộp hồ sơ tại Công an xã, thị trấn thuộc huyện, Công an thị xã, thành phố thuộc tỉnh, đăng kí tạm trú nộp hồ sơ đăng kí tạm trú tại Công an xã, phường, thị trấn.</p>\r\n\r\n<p>​</p>\r\n\r\n<p>Nay với Thông tư 55 mới, ngoài việc nộp trực tiếp ra thì Bộ cũng đã cho bổ sung hình thức tiếp nhận hồ sơ đăng ký cư trú từ cổng dịch vụ công, điều này có thể xem là rất thuận tiện và tiết kiệm thời gian làm thủ tục. Cụ thể như sau:<br />\r\n&nbsp;</p>\r\n\r\n<p><b>Điều 3. Tiếp nhận hồ sơ và thông báo về kết quả đăng kí cư trú</b><br />\r\n<br />\r\n1. Việc tiếp nhận hồ sơ đăng kí cư trú được thực hiện dưới hình thức trực tiếp tại cơ quan đăng kí cư trú, Cổng dịch vụ công quốc gia, Cổng dịch vụ công Bộ Công an, Cổng dịch vụ công quản lí cư trú.<br />\r\n<br />\r\n[....]<br />\r\n<br />\r\n3. Trường hợp thực hiện đăng kí cư trú qua Cổng dịch vụ công quốc gia, Cổng dịch vụ công Bộ Công an, Cổng dịch vụ công quản lí cư trú thì người yêu cầu đăng kí cư trú khai báo thông tin và đính kèm bản quét hoặc bản chụp các văn bản, giấy tờ cần thiết theo quy định. Công dân có trách nhiệm xuất trình bản chính các giấy tờ, tài liệu đã cung cấp khi có yêu cầu của người làm công tác đăng kí cư trú.<br />\r\n<br />\r\n<b>Điều 15. Thông báo lưu trú</b><br />\r\n<br />\r\n1. Việc thông báo lưu trú được thực hiện theo một trong các hình thức sau đây:<br />\r\n<br />\r\n[....]<br />\r\n<br />\r\nc) Thông qua trang thông tin điện tử của cơ quan đăng kí cư trú hoặc qua Cổng dịch vụ công quốc gia, Cổng dịch vụ công Bộ Công an, Cổng dịch vụ công quản lí cư trú;<br />\r\n<br />\r\nd) Thông qua ứng dụng trên thiết bị điện tử.<br />\r\n<br />\r\n<b>Điều 16. Khai báo tạm vắng</b><br />\r\n<br />\r\n1. Việc khai báo tạm vắng đối với trường hợp quy định tại điểm c và điểm d khoản 1 Điều 31 Luật Cư trú được thực hiện theo một trong các hình thức sau đây:<br />\r\n<br />\r\n[....]<br />\r\n<br />\r\nc) Trang thông tin điện tử của cơ quan đăng kí cư trú hoặc qua Cổng dịch vụ công quốc gia, Cổng dịch vụ công Bộ Công an, Cổng dịch vụ công quản lí cư trú;<br />\r\n<br />\r\nd) Ứng dụng trên thiết bị điện tử.</p>\r\n\r\n<p><a>Click to expand...</a></p>\r\n\r\n<p><br />\r\n<i>\"Việc thông báo về kết quả đăng kí thường trú, đăng kí tạm trú, gia hạn tạm trú, khai báo thông tin về cư trú, điều chỉnh thông tin về cư trú, tách hộ, khai báo tạm vắng được thực hiện dưới hình thức văn bản, tin nhắn điện tử đến hộp thư điện tử hoặc điện thoại, trang thông tin điện tử của cơ quan đăng kí cư trú, ứng dụng trên thiết bị điện tử, Cổng dịch vụ công quốc gia, Cổng dịch vụ công Bộ Công an, Cổng dịch vụ công quản lí cư trú\"</i>, Bộ này cho biết trong Thông tư mới.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/21/Web-cap-bca70414118a1ca6317.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/Web-cap-bca70414118a1ca6317.jpg\" /></p>', '<p>Thông tư 55 mới sẽ được thực hiện từ 1/7/2021 tới đây và hay thế Thông tư 35/2014/TT-BCA ban hành hồi 9/9/2014 của Bộ trưởng Bộ Công an quy định chi tiết một số điều của Luật Cư trú và Nghị định số 31/2014/NĐ-CP 18/4/2014 của Chính phủ quy định chi tiết một số điều và biện pháp thi hành Luật Cư trú.<br />\r\n<br />\r\nChi tiết về Thông tư 55/2021, bạn có thể xem tại đây:<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/000142bbc4b7746e529e.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/000142bbc4b7746e529e.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/0002f0b2335843c1e100.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/0002f0b2335843c1e100.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/00033c43fbdc98a6d05d.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/00033c43fbdc98a6d05d.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/000407ec37af568cf973.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/000407ec37af568cf973.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/0005baf72f38ee13c544.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/0005baf72f38ee13c544.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/000605b1086265d875d4.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/000605b1086265d875d4.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/00074987b2a657af1b12.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/00074987b2a657af1b12.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/000858f2c3deba0eae1d.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/000858f2c3deba0eae1d.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/0009e81123054a376221.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/0009e81123054a376221.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/001015f59b58203a24a5.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/001015f59b58203a24a5.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/001196c5953e0af9bd6f.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/001196c5953e0af9bd6f.jpg\" />&nbsp;<img alt=\"\" data-src=\"https://photo.techrum.vn/images/2021/06/21/00122014fb2d4e808f97.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/00122014fb2d4e808f97.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>', 'http://localhost:8000/uploads/files/0AE2ECAF-4648-472D-A215-2C3A835E18D3b3ca7d4548c5cc41.jpg', NULL, NULL, 'bo-cong-an-nguoi-dan-co-the-dang-ki-ho-khau-cu-tru-tam-vang-qua-mang-va-nhan-thong-bao-qua-tin-nhan-tu-172021', 'Bộ Công an: Người dân có thể đăng kí hộ khẩu, cư trú, tạm vắng qua mạng và nhận thông báo qua tin nhắn từ 1/7/2021', NULL, NULL, 'index,follow', 'index,follow', 'vi', 32, NULL, '2021-06-25 02:06:29', '2021-06-25 02:06:29'),
(33, '9e95c9c5-daeb-43d9-ac18-a007f194579a', 'Extension giúp chặn tất cả website cứ đòi gửi thông báo cho bạn trong Chrome', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/25/4BdKwP.png\" src=\"http://photo.techrum.vn/images/2019/08/25/4BdKwP.png\" /><br />\r\n<br />\r\nNgày nay, khi bạn đang mở trình duyệt web, mở tab và click vào một liên kết, bạn thường thấy các thứ như là: YouTube muốn hiển thị thông báo, Facebook muốn hiển thị thông báo. Việc này xuất hiện khá nhiều và gây phiền phức cho người dùng vì chắc hẳn ít ai muốn chấp nhận những thông báo này.</p>', '<p>Trên Chrome đã có sẽ chức năng cho phép&nbsp;<a href=\"https://www.techrum.vn/threads/lam-th-nao-d-chan-thong-bao-trang-web-xyz-mu-n-g-i-thong-bao-cho-ban-trong-chrome.149847/\">chặn thông báo</a>&nbsp;nhưng đối với một số người dùng thì điều này cũng không chặn được các website hiển thị thông báo. Do đó, nếu bạn đã thử các trên mà vẫn không được thì có thể dùng qua extension này. Đó là Block Website Notification Requests trên Chrome Store:</p>\r\n\r\n<ul>\r\n	<li data-xf-list-type=\"ul\"><a href=\"https://chrome.google.com/webstore/detail/block-website-notificatio/jpjjgdaekibbfkagoaalobjonlfplodg\" rel=\"nofollow noopener\" target=\"_blank\">Block Website Notification Requests</a></li>\r\n</ul>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://i.kinja-img.com/gawker-media/image/upload/s--uP88LqBZ--/c_fit,fl_progressive,q_80,w_636/b7uidmpadxdobnmwjjf8.gif\" src=\"https://i.kinja-img.com/gawker-media/image/upload/s--uP88LqBZ--/c_fit,fl_progressive,q_80,w_636/b7uidmpadxdobnmwjjf8.gif\" /><br />\r\n​</p>\r\n\r\n<p>Bạn chỉ cần click vào đường link trên và bấm \"Add to Chrome\" để tiến hành cài đặt là xong. Extension này sẽ tự động khoá thông báo tất cả các website, bạn không cần phải làm gì thêm cả. Như hình dưới, tinh năng thông báo đã được extension khoá lại.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/25/4BdDyG.jpg\" src=\"http://photo.techrum.vn/images/2019/08/25/4BdDyG.jpg\" /><br />\r\n​</p>\r\n\r\n<p>Dù vậy, nó có điểm yếu là sẽ khoá thông báo của TẤT CẢ mọi website và bạn không thể đưa ra danh sách loại trừ được. Tuy nhiên, cũng không nhiều người thích nhận thông báo từ website nên có thể đây là điểm yếu không đáng kể so với lợi ích mà nó mang lại.</p>', NULL, 'http://localhost:8000/uploads/files/4BdKwP%20(1).png', NULL, NULL, 'extension-giup-chan-tat-ca-website-cu-doi-gui-thong-bao-cho-ban-trong-chrome', 'Extension giúp chặn tất cả website cứ đòi gửi thông báo cho bạn trong Chrome', NULL, NULL, 'index,follow', 'index,follow', 'vi', 33, NULL, '2021-06-25 02:08:06', '2021-06-25 02:08:06'),
(34, 'aaa4ac3a-5c4c-4be9-bc99-71dfe574d52d', 'Microsoft chuẩn bị tung ra Fluid Office, bản cập nhật Office lớn nhất trong nhiều thập kỷ dành cho Windows 11', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/21/Fluid_Component_Signature_OWA_1_7f956b7ae3f70ccf.jpg\" src=\"https://photo.techrum.vn/images/2021/06/21/Fluid_Component_Signature_OWA_1_7f956b7ae3f70ccf.jpg\" />​</p>\r\n\r\n<p>Cùng với sự ra mắt của Windows 11, thì tại sự kiện \"thế hệ Windows mới\" sẽ diễn ra vào ngày 24 tháng 6 tới đây, Microsoft dự kiến sẽ cho ra mắt phiên bản mới của bộ công cụ văn phòng Microsoft Office được hàng triệu người trên thế giới tin dùng. Đó sẽ là một nền tảng web mang tên Fluid Office, giờ đây bộ công cụ văn phòng Office của Microsoft sẽ trở thành một công cụ mạnh mẽ hơn, chủ yếu tập trung vào cộng tác giữa người dùng với người dùng nhanh chóng, trực tiếp ngay trên web.</p>', '<p>Cho bạn đọc nào chưa biết thì Microsoft lần đầu tiên công bố Fluid vào năm ngoái, cho thấy cách bộ công cụ văn phòng Microsoft Office sẽ hoạt động như thế nào trên nền tảng web. Thay vì các bảng, biểu đồ và danh sách được gắn liền với các tài liệu cụ thể, thì giờ đây với Fluid Office thì chúng sẽ chuyển thành các mô-đun vô cùng linh hoạt, cho phép bạn thực hiện các tác vụ khác nhau mà không cần rời khỏi email, chat,v.v....Nói một cách đơn giản, cách tiếp cận này cho phép bạn làm việc với tài liệu trong một môi trường chung mà không cần phải chạy các ứng dụng Microsoft Office khác nhau.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/21/2021-06-21_190454280a4809fbacd156.png\" src=\"https://photo.techrum.vn/images/2021/06/21/2021-06-21_190454280a4809fbacd156.png\" />​</p>\r\n\r\n<p><br />\r\nNguồn tin cho biết rằng mọi thứ mà các nhà phát triển tại Microsoft đã tạo ra với Fluid là sự thay đổi lớn nhất của Office trong nhiều thập kỷ. Vào thời điểm được giới thiệu vào năm ngoái, Fluid concept vẫn còn khá mơ hồ đối với người dùng. Tuy nhiên giờ đây, ý tưởng đó hiện đang trở thành hiện thực, giúp người dùng có thể làm việc với nhau thông qua hình thức online khi mà đại dịch COVID-19 chưa kết thúc.<br />\r\n<br />\r\nChẳng bao lâu nữa, mọi cuộc họp trong Microsoft Teams sẽ có kèm theo ghi chú cộng tác (Notes). Ghi chú sẽ không chỉ xuất hiện trong các cuộc họp mà còn xuất hiện trong Outlook của bạn. Bất kỳ ai có quyền đều có thể viết nội dung nào đó vào ghi chú bất kỳ lúc nào và những điều chỉnh này sẽ hiển thị trực tuyến cho tất cả các thành viên của cuộc họp. Sau khi bạn thêm một task mới, nó sẽ đồng bộ hóa ngay lập tức với các task khác trong Microsoft 365.<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"https://photo.techrum.vn/images/2021/06/21/fluidbeforemeetings999f63514538de9b.gif\" src=\"https://photo.techrum.vn/images/2021/06/21/fluidbeforemeetings999f63514538de9b.gif\" />​</p>\r\n\r\n<p><br />\r\nViệc ra mắt Fluid Office trùng với thời điểm Windows 11 ra mắt cũng như thời điểm mà đại dịch COVID-19 đang ảnh hưởng đến nhân viên văn phòng trên toàn thế giới, mọi người đang phải làm việc tại nhà là một chiến dịch marketing của Microsoft. Jared Spataro, phó chủ tịch phụ trách Microsoft 365 cho biết:<br />\r\n<br />\r\n\"<i>Tại Microsoft, chúng tôi tin rằng làm việc kết hợp là xu hướng của tương lai. Để hỗ trợ nhân viên đạt được thành công trong môi trường làm việc hiện đại, doanh nghiệp sẽ cần phải định hình lại tổ chức thông qua một mô hình vận hành mới cho nhân viên, địa điểm và quy trình. Microsoft cam kết xây dựng trải nghiệm cộng tác như nhau cho mọi người, dù là người đang có mặt trong một phòng hội nghị ở Atlanta, một người đang thuyết trình từ xa tại nhà, hay một người phải xem lại bản ghi cuộc họp khi ngày làm việc mới bắt đầu ở bên kia bán cầu</i>.\"<br />\r\n&nbsp;</p>\r\n\r\n<p><iframe allowfullscreen=\"true\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/tPw5kFkXtt4?wmode=opaque&amp;start=0\" width=\"560\"></iframe></p>\r\n\r\n<p><br />\r\nDự kiến Fluid Office sẽ chính thức ra mắt tại sự kiện \"thế hệ Windows mới\" sẽ diễn ra vào ngày 24 tháng 6 tới đây của Microsoft.<br />\r\n&nbsp;</p>', NULL, 'http://localhost:8000/uploads/files/Fluid_Component_Signature_OWA_1_7f956b7ae3f70ccf.jpg', NULL, NULL, 'microsoft-chuan-bi-tung-ra-fluid-office-ban-cap-nhat-office-lon-nhat-trong-nhieu-thap-ky-danh-cho-windows-11', 'Microsoft chuẩn bị tung ra Fluid Office, bản cập nhật Office lớn nhất trong nhiều thập kỷ dành cho Windows 11', NULL, NULL, 'index,follow', 'index,follow', 'vi', 34, NULL, '2021-06-25 02:10:08', '2021-06-25 02:10:08'),
(35, '83a02a24-1481-4ea6-9c03-f8627accc7fb', '[Giải trí] Những thiết kế cầu thang sẽ khiến bạn một bước té sấp mặt', 'Vũ Quốc Tuấn', NULL, '<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBkZg.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBkZg.jpg\" /><br />\r\n<br />\r\nĐối với những gia đình sở hữu nhà nhiều tầng, cầu thang luôn là một trong những người bạn hết sức quen thuộc và giúp chúng ta có thể lên xuống dễ dàng giữa các tầng. Tuy nhiên, sẽ thế này nếu những chiếc cầu thang này bị thiết kế theo xu hướng \"lệch lạc\" và biến thành kẻ thù không độ trời chung.</p>', '<p>1. Cầu thang hay sàn gỗ?<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9Nu2.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9Nu2.jpg\" />​</p>\r\n\r\n<p><br />\r\n2. Chắc là lỗi tại tấm thảm không đủ dài<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9iYq.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9iYq.jpg\" />​</p>\r\n\r\n<p><br />\r\n3. Rồi xuống nhà kiểu gì?<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9k3G.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9k3G.jpg\" />​</p>\r\n\r\n<p><br />\r\n4. Cái cầu thang hay cái ma trận?<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9nLP.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9nLP.jpg\" />​</p>\r\n\r\n<p><br />\r\n5. \"Em làm y chang hình vẽ mà sếp\"<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9A0s.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9A0s.jpg\" />​</p>\r\n\r\n<p><br />\r\n6. Thiết kế đẹp, nhưng không cẩn thận là té như chơi<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9dcH.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9dcH.jpg\" />​</p>\r\n\r\n<p><br />\r\n7. Tưởng cuối cùng cũng là bậc thang, nhưng ai ngờ làn sàn nhà<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9ptu.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9ptu.jpg\" />​</p>\r\n\r\n<p><br />\r\n8. Xây cầu thang cho vui thôi, nhà này xài thang máy<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9qre.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9qre.jpg\" /><br />\r\n​</p>\r\n\r\n<p>9. Tiếp tục là một cái ma trận<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9Ivd.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9Ivd.jpg\" />​</p>\r\n\r\n<p><br />\r\n10. Nấc thang xuống địa ngục<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9Zsg.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9Zsg.jpg\" />​</p>\r\n\r\n<p><br />\r\n11. Cầu thang dành cho người khuyết tật?<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9yuZ.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9yuZ.jpg\" />​</p>\r\n\r\n<p><br />\r\n12. Lộn cổ như chơi<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9bjk.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9bjk.jpg\" />​</p>\r\n\r\n<p><br />\r\n13. Không thể làm cầu thang theo theo kiểu bình thường được sao?<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9r7X.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9r7X.jpg\" /><br />\r\n​</p>\r\n\r\n<p>14. Một bước vô thẳng bệnh viện<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4B9zRl.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4B9zRl.jpg\" />​</p>\r\n\r\n<p><br />\r\n15. Cạn lời luôn<br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" k-data-src=\"http://photo.techrum.vn/images/2019/08/10/4BB497.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BB497.jpg\" />​</p>\r\n\r\n<p><br />\r\n<b>Một số hình ảnh khác:</b><br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBQER.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBQER.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BB65U.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BB65U.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BB0zT.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BB0zT.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBBG0.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBBG0.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBMsD.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBMsD.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBUIV.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBUIV.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBYX2.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBYX2.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBj7q.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBj7q.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBXaG.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBXaG.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBH9P.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBH9P.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBS5s.jpg\" src=\"http://photo.techrum.vn/images/2019/08/10/4BBS5s.jpg\" />&nbsp;<img alt=\"\" data-src=\"http://photo.techrum.vn/images/2019/08/10/4BBgfH.jpg\" src=\"http://photo.tech