INSERT INTO `gigation_products_translations` (`id`, `uuid`, `name`, `price`, `discount`, `title`, `description`, `content`, `image`, `youtube`, `file`, `slug`, `title_tag`, `meta_keywords`, `meta_description`, `meta_robots`, `meta_google_bot`, `locale`, `product_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, '7d4ee14a-7025-4ee1-8da5-d60b93004013', 'Gói Tiny', 500, NULL, '<p>123</p>', '<p><strong>BizFly Cloud Server - Dịch vụ máy chủ ảo đám mây tốc độ cao, chuyên nghiệp</strong></p>', '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', 'http://localhost:8000/uploads/files/client-logo1.jpg', NULL, NULL, 'goi-tiny', 'Gói Tiny', NULL, NULL, NULL, NULL, 'vi', 3, NULL, '2021-06-29 08:20:19', '2021-06-30 18:59:13'),
(2, 'd333d574-5e72-4350-8f8c-29fcda9e22df', 'dịch vụ fullfillment', 1444, NULL, '<p>dịch vụ fullfillment là gì ?</p>', '<p>BizFly Cloud Server - Dịch vụ máy chủ ảo đám mây tốc độ cao, chuyên nghiệp</p>', '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', 'http://localhost:8000/uploads/files/4BBkZg.jpg', NULL, NULL, 'dich-vu-fullfillment', 'dịch vụ fullfillment', NULL, NULL, NULL, NULL, 'vi', 4, NULL, '2021-06-29 08:26:34', '2021-06-30 06:13:36'),
(3, '41496347-0f19-41b5-bc42-b82d635237b1', 'dịch vụ lưu trữ hồ sơ', 123, NULL, '<p>Dịch vụ lưu trữ hồ sơ là gì?</p>', '<p>BizFly Cloud Server - Dịch vụ máy chủ ảo đám mây tốc độ cao, chuyên nghiệp</p>', '<p>Cloud server là hệ thống máy chủ được ảo hóa trên nền tảng điện toán đám mây. Việc ảo hóa trên các cụm máy chủ vật lý mạnh mẽ giúp hệ thống của doanh nghiệp luôn ổn định, sẵn sàng cao, không bị tắc nghẽn khi có lượng truy cập lớn. Với lượng tài nguyên dự phòng lớn, máy chủ ảo cloud cho phép doanh nghiệp mở rộng tài nguyên gần như ngay lập tức bất cứ khi nào có nhu cầu. Lúc này doanh nghiệp không cần tốn thời gian chờ đợi mua thêm thiết bị để mở rộng/ thay thế hay lo ngại việc dừng dịch vụ quá lâu gây thiệt hại đến sản xuất kinh doanh.</p>', 'http://localhost:8000/uploads/files/4SUooE.jpg', NULL, NULL, 'dich-vu-luu-tru-ho-so', 'dịch vụ lưu trữ hồ sơ', NULL, NULL, NULL, NULL, 'vi', 5, NULL, '2021-06-29 10:26:24', '2021-06-30 05:54:01'),
